(1, 'Lần đầu với Gal', 'ln-u-vi-gal', 'http://truyendep.com/wp-content/uploads/2020/07/lan-dau-voi-gal.jpg', '\n<h2>L&#x1EA7;n &#x111;&#x1EA7;u v&#x1EDB;i Gal n&#x1ED9;i dung</h2>\n<p>T&#xE1;c gi&#x1EA3;: UENO Meguru<br>\nTruy&#x1EC7;n n&#xF3;i v&#x1EC1; m&#x1ED9;t thanh ni&#xEA;n mu&#x1ED1;n m&#x1EA5;t &#x111;i &#x201C;l&#x1EA7;n &#x111;&#x1EA7;u ti&#xEA;n&#x201D;v&#x1EDB;i em v&#x1EBF;u-san trong &#x1EA3;nh b&#xEC;a &#x1EA5;y</p>\n', 'http://truyendep.com/lan-dau-voi-gal/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(2, 'This Love That Won’t Reach', 'this-love-that-wont-reach', 'http://truyendep.com/wp-content/uploads/2020/07/this-love-that-wont-reach.jpg', '\n<h2>This Love That Won&#x2019;t Reach n&#x1ED9;i dung</h2>\n<p>M&#x1ED1;i t&#xEC;nh &#x111;&#x1A1;n ph&#x1B0;&#x1A1;ng pha ch&#xFA;t NTR v&#xE0; Yuri</p>\n', 'http://truyendep.com/this-love-that-wont-reach/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(3, 'Gantz Edo', 'gantz-edo', 'http://truyendep.com/wp-content/uploads/2020/07/gantz-edo.jpg', '\n<h2>Gantz Edo n&#x1ED9;i dung</h2>\n<p>Ti&#x1EBF;p n&#x1ED1;i c&#xE1;c th&#xE0;nh c&#xF4;ng c&#x1EE7;a c&#xE1;c seri Gantz trong qu&#xE1; kh&#x1EE9;, 1 ph&#x1EA7;n truy&#x1EC7;n Gantz m&#x1EDB;i &#x111;&#xE3; b&#x1EAF;t &#x111;&#x1EA7;u. Gantz Edo s&#x1EBD; &#x111;&#x1B0;a ch&#xFA;ng ta tr&#x1EDF; v&#x1EC1; th&#x1EDD;i k&#xEC; Nh&#x1EAD;t B&#x1EA3;n xa x&#x1B0;a, m&#x1ED9;t qu&#xE1; kh&#x1EE9; v&#x1EC1; Gantz ch&#x1B0;a ai bi&#x1EBF;t &#x111;&#x1EBF;n!!</p>\n', 'http://truyendep.com/gantz-edo/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(4, 'The Man Who Killed Nobunaga', 'the-man-who-killed-nobunaga', 'http://truyendep.com/wp-content/uploads/2020/06/the-man-who-killed-nobunaga.jpg', '\n<h2>The Man Who Killed Nobunaga n&#x1ED9;i dung</h2>\n<p>Trong s&#x1ED1; t&#x1EA5;t c&#x1EA3; c&#xE1;c nh&#xE2;n v&#x1EAD;t l&#x1ECB;ch s&#x1EED; Nh&#x1EAD;t B&#x1EA3;n, Oda Nobunaga c&#xF3; l&#x1EBD; l&#xE0; ng&#x1B0;&#x1EDD;i &#x111;&#x1B0;&#x1EE3;c th&#x1EC3; hi&#x1EC7;n s&#xE2;u nh&#x1EA5;t. Nh&#x1B0;ng Nobunaga th&#x1EF1;c s&#x1EF1; nh&#x1B0; th&#x1EBF; n&#xE0;o, v&#xE0; t&#x1EA1;i sao anh ta b&#x1ECB; ph&#x1EA3;n b&#x1ED9;i v&#xE0; s&#xE1;t h&#x1EA1;i? M&#x1EB7;c d&#xF9; r&#x1EA5;t nhi&#x1EC1;u t&#xE1;c gi&#x1EA3; manga l&#xE0;m cho c&#xE2;u chuy&#x1EC7;n c&#x1EE7;a h&#x1ECD; tr&#x1EDF; n&#xEA;n th&#xFA; v&#x1ECB; h&#x1A1;n b&#x1EB1;ng c&#xE1;ch b&#xF3;p m&#xE9;o s&#x1EF1; ki&#x1EC7;n l&#x1ECB;ch s&#x1EED;, nh&#x1B0;ng b&#x1ED9; truy&#x1EC7;n n&#xE0;y th&#xEC; ng&#x1B0;&#x1EE3;c l&#x1EA1;i, b&#x1EB1;ng c&#xE1;ch nghi&#xEA;n c&#x1EE9;u l&#x1ECB;ch s&#x1EED; &#x111;&#x1EC3; v&#x1EBD; m&#x1ED9;t b&#x1EE9;c tranh r&#xF5; r&#xE0;ng h&#x1A1;n &#x2013; nh&#x1B0;ng h&#x1EA5;p d&#x1EAB;n h&#x1A1;n v&#x1EC1; ng&#x1B0;&#x1EDD;i &#x111;&#xE0;n &#xF4;ng huy&#x1EC1;n tho&#x1EA1;i n&#xE0;y.</p>\n', 'http://truyendep.com/the-man-who-killed-nobunaga/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(5, 'Isekai Ryouridou', 'isekai-ryouridou', 'http://truyendep.com/wp-content/uploads/2020/06/isekai-ryouridou.jpg', '\n<h2>Isekai Ryouridou n&#x1ED9;i dung</h2>\n<p>Qu&#xE1;n &#x103;n nh&#xE0; Tsurumi Asuta b&#x1ECB; k&#x1EBB; x&#x1EA5;u ph&#xF3;ng h&#x1ECF;a, c&#x1EAD;u quy&#x1EBF;t t&#xE2;m lao v&#xE0;o &#x111;&#xE1;m ch&#xE1;y c&#x1ED1; g&#x1EAF;ng t&#xEC;m ki&#x1EBF;m con dao tam &#x111;&#x1EE9;c m&#xE0; cha c&#x1EAD;u v&#xF4; c&#xF9;ng y&#xEA;u qu&#xFD;. R&#x1ED3;i ch&#x1EA3; r&#xF5; &#x111;&#x1EA7;u &#x111;u&#xF4;i ra sao, c&#x1EAD;u t&#x1EC9;nh d&#x1EAD;y &#x1EDF; m&#x1ED9;t n&#x1A1;i ho&#xE0;n to&#xE0;n xa l&#x1EA1; c&#xF9;ng v&#x1EDB;i con dao tam &#x111;&#x1EE9;c trong tay.</p>\n', 'http://truyendep.com/isekai-ryouridou/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(6, 'Kenshirou ni yoroshiku', 'kenshirou-ni-yoroshiku', 'http://truyendep.com/wp-content/uploads/2020/06/kenshirou-ni-yoroshiku.jpg', '\n<h2>Kenshirou ni yoroshiku n&#x1ED9;i dung</h2>\n<p>H&#xE0;nh tr&#xEC;nh tr&#x1EA3; th&#xF9; c&#x1EE7;a m&#x1ED9;t c&#x1EAD;u b&#xE9; c&#xF2;n l&#xE0;m nh&#x1B0; n&#xE0;o th&#xEC; m&#x1EDD;i &#x111;&#x1ECD;c s&#x1EBD; r&#xF5;</p>\n', 'http://truyendep.com/kenshirou-ni-yoroshiku/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(7, 'Shounen no Abyss', 'shounen-no-abyss', 'http://truyendep.com/wp-content/uploads/2020/06/shounen-no-abyss.jpg', '\n<h2>Shounen no Abyss n&#x1ED9;i dung</h2>\n<p>Trong m&#x1ED9;t th&#x1ECB; tr&#x1EA5;n nh&#xE0;m ch&#xE1;n v&#xE0; ng&#xE0;y qua ng&#xE0;y kh&#xF4;ng c&#xF3; g&#xEC; thay &#x111;&#x1ED5;i, Reiji Kurose, m&#x1ED9;t h&#x1ECD;c sinh trung h&#x1ECD;c, &#x201C;ch&#x1EC9;&#x201D; c&#xF2;n s&#x1ED1;ng. Gia &#x111;&#xEC;nh, &#x1B0;&#x1EDB;c m&#x1A1; t&#x1B0;&#x1A1;ng lai, b&#x1EA1;n th&#x1EDD;i th&#x1A1; &#x1EA5;u. T&#x1EA5;t c&#x1EA3; &#x111;&#x1EC1;u tr&#xF3;i bu&#x1ED9;c c&#x1EAD;u &#x1EA5;y v&#xE0;o th&#x1ECB; tr&#x1EA5;n n&#xE0;y. C&#x1EAD;u lu&#xF4;n ngh&#x129;, &#x201C;T&#xF4;i ch&#x1EC9; s&#x1ED1;ng.&#x201D; cho &#x111;&#x1EBF;n khi c&#xF4; &#x1EA5;y g&#x1EB7;p c&#xF4; &#x1EA5;y. C&#xF3; hy v&#x1ECD;ng &#x111;&#x1EC3; s&#x1ED1;ng? C&#xF3; &#xE1;nh s&#xE1;ng n&#xE0;o &#x1EDF; ph&#xED;a tr&#x1B0;&#x1EDB;c kh&#xF4;ng? The World End Boy Meets Girl b&#x1EAF;t &#x111;&#x1EA7;u</p>\n', 'http://truyendep.com/shounen-no-abyss/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(8, 'Lời nguyền Lalin', 'li-nguyn-lalin', 'http://truyendep.com/wp-content/uploads/2020/06/loi-nguyen-lalin.jpg', '\n<h2>L&#x1EDD;i nguy&#x1EC1;n Lalin n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t c&#x1EAD;u thi&#x1EBF;t ni&#xEA;n &#x111;&#x1B0;&#x1EE3;c coi l&#xE0; &#x201C;t&#xED;n &#x111;&#x1ED3;&#x201D; c&#x1EE7;a s&#x1EF1; huy&#x1EC1;n b&#xED;, c&#xF9;ng v&#x1EDB;i b&#x1EA1;n th&#xE2;n c&#x1EE7;a c&#x1EAD;u ta b&#x1EA5;t &#x111;&#x1EAF;c s&#x129; b&#x1ECB; l&#xF4;i k&#xE9;o v&#xE0;o chuy&#x1EBF;n th&#xE1;m hi&#x1EC3;m t&#xEC;m ra s&#x1EF1; th&#x1EAD;t v&#x1EC1; L&#x1EDD;i nguy&#x1EC1;n c&#x1EE7;a Lalin!!<br>\nM&#x1ECC;I CHUY&#x1EC6;N D&#x1EA6;N TR&#x1EDE; N&#xCA;N KH&#xD4;NG C&#xD2;N NH&#x1AF; X&#x1AF;A!!</p>\n', 'http://truyendep.com/loi-nguyen-lalin/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(9, 'Abyss Rage', 'abyss-rage', 'http://truyendep.com/wp-content/uploads/2020/06/abyss-rage.jpg', '\n<h2>Abyss Rage n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t c&#x1EAD;u b&#xE9; m&#xF9;, Shinobu, s&#x1ED1;ng m&#x1ED9;t cu&#x1ED9;c s&#x1ED1;ng y&#xEA;n b&#xEC;nh v&#x1EDB;i s&#x1EF1; h&#x1ED7; tr&#x1EE3; t&#x1EAD;n t&#xEC;nh c&#x1EE7;a th&#x1EA7;y gi&#xE1;o v&#xE0; c&#xF4; b&#x1EA1;n g&#xE1;i, Mikoto. C&#x1EAD;u luy&#x1EC7;n t&#x1EAD;p h&#xE0;ng ng&#xE0;y &#x111;&#x1EC3; h&#x1ECD;c m&#xF4;n v&#xF5; thu&#x1EAD;t t&#x1EF1; v&#x1EC7; c&#x1ED5; x&#x1B0;a c&#xF3; t&#xEA;n l&#xE0; Mibuchi Toshujutsu. Cho &#x111;&#x1EBF;n m&#x1ED9;t ng&#xE0;y, khi t&#x1EA5;t c&#x1EA3; m&#x1ECD;i th&#x1EE9; c&#x1EAD;u y&#xEA;u th&#x1B0;&#x1A1;ng b&#x1ECB; &#x111;&#xE1;nh c&#x1EAF;p b&#x1EDF;i m&#x1ED9;t v&#x1ECB; kh&#xE1;ch l&#x1EA1; xu&#x1EA5;t hi&#x1EC7;n &#x1EDF; v&#xF5; &#x111;&#x1B0;&#x1EDD;ng. Ng&#x1B0;&#x1EDD;i &#x111;&#xE0;n &#xF4;ng n&#xE0;y, &#x111;&#xE1;nh b&#x1EA1;i c&#x1EA3; Shinobu v&#xE0; th&#x1EA7;y gi&#xE1;o c&#x1EE7;a c&#x1EAD;u, b&#x1EAF;t Mikoto &#x111;i v&#x1EDB;i h&#x1EAF;n. Ba n&#x103;m tr&#xF4;i qua, &#x111;&#x1EC3; gi&#xE0;nh l&#x1EA1;i b&#x1EA1;n g&#xE1;i c&#x1EE7;a m&#xEC;nh, Shinobu v&#x1EF1;c l&#xEA;n t&#x1EEB; s&#xE2;u th&#x1EB3;m tuy&#x1EC7;t v&#x1ECD;ng v&#xE0; th&#x1EA5;y m&#xEC;nh &#x1EDF; m&#x1ED9;t nh&#xE0; t&#xF9; tr&#xEA;n &#x111;&#x1EA3;o xa, n&#x1A1;i giam gi&#x1EEF; &#x111;&#x1EE7; lo&#x1EA1;i t&#x1ED9;i ph&#x1EA1;m gh&#xEA; t&#x1EDF;m nh&#x1EA5;t. B&#x1EAF;t &#x111;&#x1EA7;u m&#x1ED9;t tr&#x1EAD;n chi&#x1EBF;n quy&#x1EBF;t li&#x1EC7;t, m&#x1ED9;t cu&#x1ED9;c chi&#x1EBF;n t&#x1EF1; do v&#x1EDB;i nh&#x1EEF;ng k&#x1EBB; x&#x1EA5;u xa trong ng&#x1EE5;c t&#xF9;!!</p>\n', 'http://truyendep.com/abyss-rage/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(10, 'Các one-shot của Fujiko Fujio', 'cac-one-shot-ca-fujiko-fujio', 'http://truyendep.com/wp-content/uploads/2020/06/cac-one-shot-cua-fujiko-fujio.jpg', '\n<h2>C&#xE1;c one-shot c&#x1EE7;a Fujiko Fujio n&#x1ED9;i dung</h2>\n<p>T&#x1EAD;p h&#x1EE3;p nh&#x1EEF;ng c&#xE2;u chuy&#x1EC7;n ng&#x1EAF;n ch&#x1B0;a t&#x1EEB;ng &#x111;&#x1B0;&#x1EE3;c d&#x1ECB;ch sang ti&#x1EBF;ng Vi&#x1EC7;t c&#x1EE7;a b&#x1ED9; &#x111;&#xF4;i t&#xE1;c gi&#x1EA3; Fujiko Fujio v&#x1EDB;i n&#xE9;t v&#x1EBD; komodo quen thu&#x1ED9;c kh&#xF4;ng th&#x1EC3; nh&#x1EA7;m l&#x1EAB;n v&#x1EDB;i ai. Kh&#xF4;ng h&#x1EC1; n&#xE9; tr&#xE1;nh nh&#x1EEF;ng v&#x1EA5;n &#x111;&#x1EC1; nh&#x1EA1;y c&#x1EA3;m nh&#x1B0; t&#xEC;nh d&#x1EE5;c, kh&#x1ECF;a th&#xE2;n, m&#xE1;u me, b&#x1EA1;o l&#x1EF1;c, h&#x1EE9;a h&#x1EB9;n nh&#x1EEF;ng c&#xE1;i k&#x1EBF;t b&#x1EA5;t ng&#x1EDD;. M&#x1EDD;i c&#xE1;c b&#x1EA1;n c&#xF9;ng theo d&#xF5;i</p>\n', 'http://truyendep.com/cac-one-shot-cua-fujiko-fujio/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(11, 'Mã Nguồn Ký Ức', 'ma-ngun-k-c', 'http://truyendep.com/wp-content/uploads/2020/06/ma-nguon-ky-uc.jpg', '\n<h2>M&#xE3; Ngu&#x1ED3;n K&#xFD; &#x1EE8;c n&#x1ED9;i dung</h2>\n<p>T&#x1EC9;nh d&#x1EAD;y trong xe h&#x1A1;i v&#x1EDB;i kh&#xF4;ng m&#x1ED9;t ch&#xFA;t k&#xFD; &#x1EE9;c v&#x1EC1; b&#x1EA3;n th&#xE2;n, Saikado lao v&#xE0;o con &#x111;&#x1B0;&#x1EDD;ng l&#x1EDB;n trong v&#xF4; th&#x1EE9;c sau khi nghe th&#x1EA5;y ti&#x1EBF;ng n&#x1ED5;. Tr&#xEA;n con &#x111;&#x1B0;&#x1EDD;ng la li&#x1EC7;t x&#xE1;c xe h&#x1A1;i tai n&#x1EA1;n, &#x111;&#x1ED1;i di&#x1EC7;n v&#x1EDB;i vi&#x1EC7;c ph&#xE1;t hi&#x1EC7;n ra r&#x1EB1;ng to&#xE0;n b&#x1ED9; xe tr&#xEA;n con &#x111;&#x1B0;&#x1EDD;ng kh&#xF4;ng th&#x1EC3; gi&#x1EA3;m t&#x1ED1;c &#x111;&#x1ED9; v&#xEC; phanh &#x111;&#xE3; h&#x1ECF;ng. Li&#x1EC7;u Saikado s&#x1EBD; l&#xE0;m g&#xEC; &#x111;&#x1EC3; tho&#xE1;t kh&#x1ECF;i t&#xEC;nh tr&#x1EA1;ng n&#xE0;y v&#xE0; t&#xEC;m ra th&#x1EAD;t s&#x1EF1; m&#x1ECD;i vi&#x1EC7;c n&#xE0;y l&#xE0; g&#xEC;&#x2026;?</p>\n', 'http://truyendep.com/ma-nguon-ky-uc/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(12, 'Shinigami Bocchan to Kuro Maid', 'shinigami-bocchan-to-kuro-maid', 'http://truyendep.com/wp-content/uploads/2020/05/shinigami-bocchan-to-kuro-maid.jpg', '\n<h2>Shinigami Bocchan to Kuro Maid n&#x1ED9;i dung</h2>\n<p>1 ch&#xE0;ng trai mang l&#x1EDD;i nguy&#x1EC1;n ch&#x1EA1;m &#x111;&#xE2;u ch&#x1EBF;t &#x111;&#xF3; v&#xE0; c&#xF4; h&#x1EA7;u g&#xE1;i c&#x1EE7;a c&#x1EAD;u</p>\n', 'http://truyendep.com/shinigami-bocchan-to-kuro-maid/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(13, 'Song Hồn', 'song-hn', 'http://truyendep.com/wp-content/uploads/2020/05/song-hon.jpg', '\n<h2>Song H&#x1ED3;n n&#x1ED9;i dung</h2>\n<p>Sau khi b&#x1ECB; m&#x1ED9;t b&#x103;ng &#x111;&#x1EA3;ng x&#xE3; h&#x1ED9;i &#x111;en s&#xE1;t h&#x1EA1;i trong m&#x1ED9;t nh&#xE0; m&#xE1;y b&#x1ECF; hoang, linh h&#x1ED3;n c&#x1EE7;a m&#x1ED9;t th&#xE1;m t&#x1EED; &#x111;&#xE3; kh&#xF4;ng th&#x1EC3; &#x111;&#x1EA7;u thai m&#xE0; tr&#x1EDF; th&#xE0;nh m&#x1ED9;t linh h&#x1ED3;n b&#xE1;o th&#xF9; &#x111;i v&#x1EA5;t v&#x1B0;&#x1EDF;ng ch&#x1ED1;n nh&#xE2;n gian. M&#x1ECD;i chuy&#x1EC7;n &#x111;&#xE3; thay &#x111;&#x1ED5;i khi linh h&#x1ED3;n b&#xE1;o th&#xF9; &#x1EA5;y nh&#x1EAD;p v&#xE0;o th&#xE2;n x&#xE1;c c&#x1EE7;a m&#x1ED9;t c&#x1EAD;u h&#x1ECD;c sinh b&#x1ECB; b&#x1EAF;t n&#x1EA1;t. T&#x1EEB; &#x111;&#xE2;y, c&#x1EA3; hai &#x111;&#xE3; c&#xF3; nh&#x1EEF;ng tr&#x1EA3;i nghi&#x1EC7;m m&#xE0; cu&#x1ED9;c &#x111;&#x1EDD;i m&#xEC;nh ch&#x1B0;a t&#x1EEB;ng g&#x1EB7;p tr&#x1B0;&#x1EDB;c &#x111;&#xE2;y!</p>\n', 'http://truyendep.com/song-hon/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(14, 'Huyền Thoại Về Những Anh Hùng Dải Ngân Hà', 'huyn-thoi-v-nhng-anh-hung-di-ngan-ha', 'http://truyendep.com/wp-content/uploads/2020/05/huyen-thoai-ve-nhung-anh-hung-dai-ngan-ha.jpg', '\n<h2>Huy&#x1EC1;n Tho&#x1EA1;i V&#x1EC1; Nh&#x1EEF;ng Anh H&#xF9;ng D&#x1EA3;i Ng&#xE2;n H&#xE0; n&#x1ED9;i dung</h2>\n<p>1984 Sau c&#xF4;ng nguy&#xEA;n<br>\nT&#x1EAD;p &#x111;&#x1EA7;u ti&#xEA;n c&#x1EE7;a ti&#x1EC3;u thuy&#x1EBF;t &#x201C;Legend of the Galactic Heroes&#x201D; &#x111;&#x1B0;&#x1EE3;c xu&#x1EA5;t b&#x1EA3;n b&#x1EDF;i NXB TOKUMA SHOTEN. &#x110;&#xF3; l&#xE0; m&#x1ED9;t s&#x1EA3;n ph&#x1EA9;m b&#xE1;n ch&#x1EA1;y n&#x1ED5;i ti&#x1EBF;ng, v&#xE0; t&#x1EEB; &#x111;&#xF3;, v&#x1EAB;n gi&#xE0;nh &#x111;&#x1B0;&#x1EE3;c s&#x1EF1; ch&#xFA; &#xFD; t&#x1EEB; c&#xE1;c th&#x1EBF; h&#x1EC7; &#x111;&#x1ED9;c gi&#x1EA3;.<br>\nM&#x1EB7;c d&#xF9; &#x111;&#xE3; nhi&#x1EC1;u n&#x103;m tr&#xF4;i qua, c&#xE2;u chuy&#x1EC7;n v&#x1EAB;n c&#xF2;n r&#x1EA5;t th&#x1EAD;t.<br>\nS&#x1EF1; s&#x1ED1;ng v&#xE0; c&#xE1;i ch&#x1EBF;t c&#x1EE7;a c&#xE1;c anh h&#xF9;ng trong c&#xE2;u chuy&#x1EC7;n ch&#x1EAF;c ch&#x1EAF;n s&#x1EBD; s&#x1B0;&#x1EDF;i &#x1EA5;m tr&#xE1;i tim b&#x1EA1;n k&#x1EC3; c&#x1EA3; &#x111;&#xF3; l&#xE0; th&#x1EDD;i hi&#x1EC7;n &#x111;&#x1EA1;i&#x2026;.</p>\n', 'http://truyendep.com/huyen-thoai-ve-nhung-anh-hung-dai-ngan-ha/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(15, 'Undead + Unluck', 'undead-unluck', 'http://truyendep.com/wp-content/uploads/2020/05/undead-unluck.jpg', '\n<h2>Undead + Unluck Full n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t c&#xF4; g&#xE1;i c&#xF3; kh&#x1EA3; n&#x103;ng khi&#x1EBF;n cho nh&#x1EEF;ng ai ti&#x1EBF;p x&#xFA;c v&#x1EDB;i c&#xF4; g&#x1EB7;p xui x&#x1EBB;o, t&#xF9;y theo m&#x1EE9;c &#x111;&#x1ED9; ti&#x1EBF;p x&#xFA;c v&#xE0; th&#x1EDD;i gian m&#xE0; v&#x1EAD;n xui l&#x1EDB;n hay nh&#x1ECF;. C&#xF4; ch&#xE1;n n&#x1EA3;n &#x111;&#x1ECB;nh t&#xEC;m c&#xE1;i ch&#x1EBF;t ;th&#xEC; t&#xEC;nh c&#x1EDD; m&#x1ED9;t ng&#x1B0;&#x1EDD;i b&#x1EA5;t t&#x1EED; c&#x169;ng &#x111;ang mu&#x1ED1;n ch&#x1EBF;t.</p>\n', 'http://truyendep.com/undead-unluck-2/', 'Hoàn thành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(16, 'Chiến Binh Từ Thế Giới Khác', 'chin-binh-t-th-gii-khac', 'http://truyendep.com/wp-content/uploads/2020/05/chien-binh-tu-the-gioi-khac.jpg', '\n<h2>Chi&#x1EBF;n Binh T&#x1EEB; Th&#x1EBF; Gi&#x1EDB;i Kh&#xE1;c n&#x1ED9;i dung</h2>\n<p>Thanh ni&#xEA;n Kang Chul Ho l&#xE0; m&#x1ED9;t &#x111;i&#x1EC3;n h&#xEC;nh c&#x1EE7;a &#x111;&#x1EA1;i &#x111;a s&#x1ED1; sinh vi&#xEA;n &#x111;&#x1EA1;i h&#x1ECD;c v&#x1EEB;a ra tr&#x1B0;&#x1EDD;ng: th&#x1EA5;t nghi&#x1EC7;p, n&#x1EE3; n&#x1EA7;n, m&#x1ED3;m ng&#x1EAD;m h&#xE0;nh,&#x2026;<br>\nM&#x1ED9;t h&#xF4;m, thanh ni&#xEA;n n&#xE0;y l&#x1B0;&#x1EDB;t web t&#xEC;m vi&#x1EC7;c l&#xE0;m th&#xEC; &#x111;hs l&#x1EA1;i b&#x1ECB; xuy&#xEA;n kh&#xF4;ng sang m&#x1ED9;t th&#x1EBF; gi&#x1EDB;i kh&#xE1;c to&#xE0;n l&#xE0; chi&#x1EBF;n tranh.<br>\nV&#x1EDB;i th&#xE2;n ph&#x1EAD;n m&#x1EDB;i l&#xE0; Parsons, li&#x1EC7;u thanh ni&#xEA;n n&#xE0;y ph&#x1EBF; v&#x1EAD;t n&#xE0;y c&#xF3; th&#x1EC3; ch&#x1EE9;ng minh r&#x1EB1;ng m&#xEC;nh x&#x1EE9;ng &#x111;&#xE1;ng l&#xE0;m main c&#x1EE7;a b&#x1ED9; truy&#x1EC7;n?</p>\n', 'http://truyendep.com/chien-binh-tu-the-gioi-khac/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(17, 'The Ultimate Middle-Aged Hunter Travels To Another World ~This Time, He Wants To Live A Slow And Pea', 'the-ultimate-middle-aged-hunter-travels-to-another-world-this-time-he-wants-to-live-a-slow-and-pea', 'http://truyendep.com/wp-content/uploads/2020/05/the-ultimate-middle-aged-hunter-travels-to-another-world-this-time-he-wants-to-live-a-slow-and-pea.jpg', '\n<h2>The Ultimate Middle-Aged Hunter Travels To Another World ~This Time, He Wants To Live A Slow And Pea n&#x1ED9;i dung</h2>\n', 'http://truyendep.com/the-ultimate-middle-aged-hunter-travels-to-another-world-this-time-he-wants-to-live-a-slow-and-pea/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(18, 'Bí Ngô Cuồng Sát – Pumpkin Night', 'bi-ngo-cung-sat-pumpkin-night', 'http://truyendep.com/wp-content/uploads/2020/04/bi-ngo-cuong-sat-pumpkin-night.jpg', '\n<h2>B&#xED; Ng&#xF4; Cu&#x1ED3;ng S&#xE1;t &#x2013; Pumpkin Night n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t k&#x1EBB; gi&#x1EBF;t ng&#x1B0;&#x1EDD;i &#x111;eo m&#x1EB7;t n&#x1EA1; b&#xED; ng&#xF4;? Nguy&#xEA;n nh&#xE2;n c&#x1EE7;a t&#x1ED9;i &#xE1;c n&#xE0;y l&#xE0; &#x2026;? Truy&#x1EC7;n kh&#xF4;ng d&#xE0;nh cho l&#x1EE9;a tu&#x1ED5;i d&#x1B0;&#x1EDB;i 18</p>\n', 'http://truyendep.com/bi-ngo-cuong-sat-pumpkin-night/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(19, 'Mato Seihei No Slave', 'mato-seihei-no-slave', 'http://truyendep.com/wp-content/uploads/2020/04/mato-seihei-no-slave.jpg', '\n<h2>Mato Seihei No Slave n&#x1ED9;i dung</h2>\n<p>K&#x1EC3; v&#x1EC1; nh&#x1EEF;ng cu&#x1ED9;c chi&#x1EBF;n ch&#x1ED1;ng l&#x1EA1;i nh&#x1EEF;ng con qu&#x1EF7; &#x1EDF; trong Ma &#x111;&#xF4; (Th&#xE0;nh ph&#x1ED1; ma thu&#x1EAD;t). C&#xF9;ng t&#xE1;c gi&#x1EA3; v&#x1EDB;i Akame ga Kill</p>\n', 'http://truyendep.com/mato-seihei-no-slave/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(20, 'Quần Đảo Ký Sinh', 'qun-o-k-sinh', 'http://truyendep.com/wp-content/uploads/2020/04/quan-dao-ky-sinh.jpg', '\n<h2>Qu&#x1EA7;n &#x110;&#x1EA3;o K&#xFD; Sinh n&#x1ED9;i dung</h2>\n<p>Qu&#x1EA7;n &#x111;&#x1EA3;o k&#xFD; sinh Do b&#x1ED1; m&#x1EB9; ly d&#x1ECB;, Sendou Chihiro, n&#x1EEF; sinh cao trung, &#x111;&#xE3; chuy&#x1EC3;n t&#x1EEB; Tokyo &#x111;&#x1EBF;n s&#x1ED1;ng &#x1EDF; h&#xF2;n &#x111;&#x1EA3;o Hanajima xa l&#x1EA1;. &#x1EDE; tr&#xEA;n h&#xF2;n &#x111;&#x1EA3;o m&#xE0; c&#xF4; n&#x1EEF; sinh chuy&#x1EC3;n t&#x1EDB;i sinh s&#x1ED1;ng n&#xE0;y, c&#xF3; g&#xEC; &#x111;&#xF3; r&#x1EA5;t l&#xE0; k&#xEC; l&#x1EA1;. Ch&#x1EB3;ng h&#x1EA1;n nh&#x1B0;: s&#x1EF1; k&#xEC; th&#x1ECB; ng&#x1B0;&#x1EDD;i ngo&#xE0;i m&#x1ED9;t c&#xE1;ch l&#x1ED9; li&#x1EC5;u, nh&#x1EEF;ng nghi th&#x1EE9;c b&#xED; &#x1EA9;n &#x111;&#x1ED9;t nhi&#xEA;n &#x111;&#x1B0;&#x1EE3;c t&#x1ED5; ch&#x1EE9;c v&#xE0; c&#x1EA3; &#x201C;th&#xE1;p c&#x1EA5;p n&#x1B0;&#x1EDB;c&#x201D; kh&#x1ED5;ng l&#x1ED3; &#x111;&#x1B0;&#x1EE3;c x&#xE2;y t&#x1EA1;i trung t&#xE2;m h&#xF2;n &#x111;&#x1EA3;o. M&#x1ED9;t ng&#xE0;y n&#x1ECD;, tr&#xEA;n h&#xF2;n &#x111;&#x1EA3;o c&#x1EE7;a nh&#x1EEF;ng ng&#x1B0;&#x1EDD;i d&#xE2;n c&#xF3; m&#x1ED1;i li&#xEA;n k&#x1EBF;t b&#x1EC1;n ch&#x1EB7;t &#x1EA5;y, x&#x1EA3;y ra v&#x1EE5; &#xE1;n m&#x1ED9;t ng&#x1B0;&#x1EDD;i ng&#x1B0; d&#xE2;n &#x111;&#xE3; b&#x1ECB; &#x111;&#xE2;m &#x111;&#x1EBF;n ch&#x1EBF;t t&#x1EA1;i nh&#xE0; c&#x1EE7;a m&#xEC;nh. Trong l&#xFA;c s&#x1EF1; ho&#xE0;i nghi c&#xF2;n &#x111;ang bao tr&#xF9;m l&#xEA;n to&#xE0;n &#x111;&#x1EA3;o nh&#x1B0; th&#x1EBF;, th&#x1EAD;t b&#x1EA5;t ng&#x1EDD; khi nh&#xEC;n th&#x1EA5;y k&#x1EBB; th&#x1EE7; &#xE1;c ch&#xED;nh l&#xE0;&#x2026;!!</p>\n', 'http://truyendep.com/quan-dao-ky-sinh/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(21, 'Sát Nhân Ếch Xanh', 'sat-nhan-ch-xanh', 'http://truyendep.com/wp-content/uploads/2020/04/sat-nhan-ech-xanh.jpg', '\n<h2>S&#xE1;t Nh&#xE2;n &#x1EBE;ch Xanh n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t lo&#x1EA1;t v&#x1EE5; &#xE1;n m&#x1EA1;ng t&#xE0;n kh&#x1ED1;c di&#x1EC5;n ra li&#xEA;n t&#x1EE5;c, n&#x1EA1;n nh&#xE2;n b&#x1ECB; h&#xE0;nh h&#x1EA1; &#x111;&#x1EBF;n ch&#x1EBF;t khi v&#x1EAB;n c&#xF2;n t&#x1EC9;nh t&#xE1;o, t&#x1EA5;t c&#x1EA3; nh&#x1EEF;ng g&#xEC; c&#x1EA3;nh s&#xE1;t bi&#x1EBF;t &#x111;&#x1B0;&#x1EE3;c ch&#x1EC9; l&#xE0; hung th&#x1EE7; m&#x1EB7;c m&#x1ED9;t b&#x1ED9; &#xE1;o m&#x1B0;a v&#xE0; &#x111;&#x1ED9;i m&#x169; &#x1EBF;ch xanh. Hisashi Sawamura, trung s&#x129; ph&#x1EE5; tr&#xE1;ch v&#x1EE5; &#xE1;n &#x111;&#xE3; v&#xE0; &#x111;ang c&#x1ED1; g&#x1EAF;ng h&#x1EBF;t s&#x1EE9;c &#x111;&#x1EC3; c&#xF3; th&#x1EC3; l&#xF4;i hung th&#x1EE7; ra &#xE1;nh s&#xE1;ng, th&#x1EBF; nh&#x1B0;ng anh l&#x1EA1;i tr&#x1EDF; th&#xE0;nh m&#x1EE5;c ti&#xEA;u c&#x1EE7;a t&#xEA;n s&#xE1;t nh&#xE2;n mang m&#x169; &#x1EBF;ch xanh &#x111;&#xF3;. Li&#x1EC7;u anh ta c&#xF3; th&#x1EC3; b&#x1EAF;t &#x111;&#x1B0;&#x1EE3;c hung th&#x1EE7;, hay s&#x1EBD; b&#x1ECB; s&#xE1;t h&#x1EA1;i?</p>\n', 'http://truyendep.com/sat-nhan-ech-xanh/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(22, 'Undine wa kyou mo koi wo suru ka?', 'undine-wa-kyou-mo-koi-wo-suru-ka', 'http://truyendep.com/wp-content/uploads/2020/04/undine-wa-kyou-mo-koi-wo-suru-ka.jpg', '\n<h2>Undine wa kyou mo koi wo suru ka? n&#x1ED9;i dung</h2>\n<p>Truy&#x1EC7;n v&#x1EC1; th&#x1EA7;n n&#x1B0;&#x1EDB;c nh&#xE0; ng&#x1B0;&#x1EDD;i ta&#xA0;Xin tr&#xE2;n tr&#x1ECD;ng c&#x1EA3;m &#x1A1;n Mino Team &#x111;&#xE3; h&#x1EE3;p t&#xE1;c v&#x1EDB;i 7 Fingers Team &#x111;&#x1EC3; d&#x1ECB;ch b&#x1ED9; truy&#x1EC7;n n&#xE0;y!</p>\n', 'http://truyendep.com/undine-wa-kyou-mo-koi-wo-suru-ka/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(23, 'Chand Ra Has', 'chand-ra-has', 'http://truyendep.com/wp-content/uploads/2020/04/chand-ra-has.jpg', '\n<h2>Chand Ra Has n&#x1ED9;i dung</h2>\n<p>Th&#x1EBF; gi&#x1EDB;i &#x111;&#x1B0;&#x1EE3;c gi&#x1EA3;i c&#x1EE9;u b&#x1EDF;i 7 ng&#x1B0;&#x1EDD;i anh h&#xF9;ng. C&#xF4; g&#xE1;i mang d&#xF2;ng m&#xE1;u c&#x1EE7;a anh h&#xF9;ng &#x2013; Himalaya &#x111;&#x1ED1;i &#x111;&#x1EA7;u v&#x1EDB;i nh&#x1EEF;ng con r&#x1ED3;ng b&#x1EB1;ng kh&#x1EA3; n&#x103;ng &#x111;&#x1B0;&#x1EE3;c th&#x1EEB;a k&#x1EBF; t&#x1EEB; h&#x1ECD;. Tuy nhi&#xEA;n s&#x1EF1; th&#x1EAD;t c&#xF2;n b&#x1ECB; ch&#xF4;n v&#xF9;i trong b&#xF3;ng t&#x1ED1;i&#x2026;</p>\n', 'http://truyendep.com/chand-ra-has/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(24, 'Yuukyuu no Gusha Asley no, Kenja no Susume', 'yuukyuu-no-gusha-asley-no-kenja-no-susume', 'http://truyendep.com/wp-content/uploads/2020/04/yuukyuu-no-gusha-asley-no-kenja-no-susume.jpg', '\n<h2>Yuukyuu no Gusha Asley no, Kenja no Susume n&#x1ED9;i dung</h2>\n<p>T&#x1EEB; khi c&#xF2;n nh&#x1ECF;, Asley lu&#xF4;n b&#x1ECB; m&#x1ECD;i ng&#x1B0;&#x1EDD;i xung quanh c&#x1B0;&#x1EDD;i nh&#x1EA1;o v&#xEC; c&#x1EAD;u l&#xFA;c n&#xE0;o c&#x169;ng &#x111;&#x1EE9;ng b&#xE9;t b&#x1EA3;ng trong h&#x1ECD;c vi&#x1EC7;n ma ph&#xE1;p. Nh&#x1B0;ng khi c&#x1EAD;u v&#xF4; t&#xEC;nh ch&#x1EBF; t&#x1EA1;o &#x111;&#x1B0;&#x1EE3;c l&#x1ECD; thu&#x1ED1;c huy&#x1EC1;n tho&#x1EA1;i b&#x1EA5;t di&#x1EC7;t, m&#x1ECD;i chuy&#x1EC7;n &#x111;&#xE3; thay &#x111;&#x1ED5;i. C&#x1EAD;u &#x111;&#xE3; c&#xF3; m&#x1ED9;tc&#x1A1; th&#x1EC3; b&#x1EA5;t t&#x1EED;. V&#xEC; mu&#x1ED1;n tr&#x1EA3; &#x111;&#x169;a nh&#x1EEF;ng ng&#x1B0;&#x1EDD;i &#x111;&#xE3; c&#x1B0;&#x1EDD;i nh&#x1EA1;o m&#xEC;nh, Asley v&#xF9;i &#x111;&#x1EA7;u v&#xE0;o nghi&#xEA;n c&#x1EE9;u ma ph&#xE1;p kh&#x1EAF;p n&#x1A1;i tr&#xEA;n th&#x1EBF; gi&#x1EDB;i. Tr&#x1EA3;i qua 5000 n&#x103;m nghi&#xEA;n c&#x1EE9;u, Asley kh&#xF4;ng nh&#x1EAD;n ra l&#xE0; m&#xEC;nh &#x111;&#xE3; tr&#x1EDF; th&#xE0;nh &#x110;&#x1EA1;i ma ph&#xE1;p s&#x1B0; v&#x1EDB;i kho ki&#x1EBF;n th&#x1EE9;c kh&#x1ED5;ng l&#x1ED3;. Tuy nhi&#xEA;n, nh&#x1EEF;ng ng&#x1B0;&#x1EDD;i m&#xE0; anh &#x1EA5;y mu&#x1ED1;n tr&#x1EA3; &#x111;&#x169;a &#x111;&#xE3; &#x111;i xa r&#x1ED3;i. M&#x1EA5;t m&#x1EE5;c &#x111;&#xED;ch s&#x1ED1;ng, Asley c&#xF9;ng Pochi (gia &#x111;&#xEC;nh c&#xF2;n l&#x1EA1;i c&#x1EE7;a anh &#x1EA5;y) l&#xEA;n &#x111;&#x1B0;&#x1EDD;ng tr&#xEA;n chuy&#x1EBF;n h&#xE0;nh tr&#xEC;nh kh&#xE1;m ph&#xE1; th&#x1EBF; gi&#x1EDB;i sau 5000 n&#x103;m. H&#xE3;y c&#xF9;ng d&#xF5;i theo h&#xE0;nh tr&#xEC;nh l&#x1EAD;p harem c&#x1EE7;a &#xF4;ng gi&#xE0; 5000 tu&#x1ED5;i nh&#xE9;! &#x2026;</p>\n', 'http://truyendep.com/yuukyuu-no-gusha-asley-no-kenja-no-susume/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(25, 'Furyou Taimashi Reina', 'furyou-taimashi-reina', 'http://truyendep.com/wp-content/uploads/2020/04/furyou-taimashi-reina.jpg', '\n<h2>Furyou Taimashi Reina n&#x1ED9;i dung</h2>\n<p>Reina Suzuno, n&#x1EEF; sinh m&#x1EDB;i chuy&#x1EC3;n &#x111;&#x1EBF;n &#x111;&#xE3; khi&#x1EBF;n cho &#x111;&#xE1;m b&#x1EA1;n c&#xF9;ng l&#x1EDB;p ch&#x1EBF;t l&#x1EB7;ng b&#x1EDF;i v&#x1EBB; ngo&#xE0;i kh&#xF3; g&#x1EA7;n, ng&#xF4;n t&#x1EEB; s&#x1EB7;c m&#xF9;i ch&#x1EE3; b&#xFA;a v&#xE0; nh&#x1EEF;ng h&#xE0;nh &#x111;&#x1ED9;ng nh&#x1B0; th&#x1EC3; b&#x1EAF;t n&#x1EA1;t b&#x1EA1;n h&#x1ECD;c. C&#xF4; ta c&#xF3; th&#x1EF1;c s&#x1EF1; l&#xE0; m&#x1ED9;t k&#x1EBB; b&#x1EAF;t n&#x1EA1;t kh&#xF4;ng? R&#xF5; r&#xE0;ng kh&#xF4;ng, &#x111;&#xE2;y ch&#xED;nh l&#xE0; c&#xE1;ch tr&#x1EEB; t&#xE0; c&#x1EE7;a ch&#x1ECB; &#x111;&#x1EA1;i cao tay &#x1EA5;n n&#xE0;y: tr&#x1EEB; t&#xE0; b&#x1EB1;ng nh&#x1EEF;ng ng&#xF4;n t&#x1EEB; c&#x1EE7;a d&#xE2;n ch&#x1EE3; b&#xFA;a</p>\n', 'http://truyendep.com/furyou-taimashi-reina/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(26, 'Mouryou Shoujo', 'mouryou-shoujo', 'http://truyendep.com/wp-content/uploads/2020/04/mouryou-shoujo.jpg', '\n<h2>Mouryou Shoujo n&#x1ED9;i dung</h2>\n<p>Dororo phi&#xEA;n b&#x1EA3;n main&#xA0;l&#x1EA7;y l&#x1ED9;i ch&#x103;ng :v</p>\n', 'http://truyendep.com/mouryou-shoujo/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
