(28, 'Awkward Senpai.', 'awkward-senpai', 'http://truyendep.com/wp-content/uploads/2020/04/awkward-senpai.jpg', '\n<h2>Awkward Senpai. n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t c&#xE2;u truy&#x1EC7;n d&#x1EC5; th&#x1B0;&#x1A1;ng v&#x1EC1; c&#xF4; &#x111;&#x1ED3;ng nghi&#x1EC7;p kh&#xF4;ng th&#x1EC3; b&#xE0;y t&#x1ECF; t&#xEC;nh y&#xEA;u choc&#x1EA5;p d&#x1B0;&#x1EDB;ic&#x1EE7;a m&#xEC;nh. B&#x1EA3;n Spin-off:https://hocvientruyentranh.net/truyen/8706/awkward-senpai B&#x1EA3;npixiv:https://hocvientruyentranh.net/truyen/7109/awkward-senpai</p>\n', 'http://truyendep.com/awkward-senpai/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(29, 'Tokyo卍Revengers', 'tokyorevengers', 'http://truyendep.com/wp-content/uploads/2020/04/Tokyo-Revengers.jpg', '\n<h2>Tokyo&#x534D;Revengers n&#x1ED9;i dung</h2>\n<p>Takemichi, thanh ni&#xEA;n th&#x1EA5;t nghi&#x1EC7;p c&#xF2;n trinh, &#x111;&#x1B0;&#x1EE3;c bi&#x1EBF;t r&#x1EB1;ng ng&#x1B0;&#x1EDD;i con g&#xE1;i &#x111;&#x1EA7;u ti&#xEA;n v&#xE0; c&#x169;ng l&#xE0; duy nh&#x1EA5;t cho &#x111;&#x1EBF;n b&#xE2;y gi&#x1EDD; m&#xE0; anh h&#x1EB9;n h&#xF2; t&#x1EEB; trung h&#x1ECD;c &#x111;&#xE3; ch&#x1EBF;t. Sau m&#x1ED9;t v&#x1EE5; tai n&#x1EA1;n, anh ta th&#x1EA5;y m&#xEC;nh &#x111;&#x1B0;&#x1EE3;c quay v&#x1EC1; nh&#x1EEF;ng ng&#xE0;y c&#x1EA5;p hai. Anh ta th&#x1EC1; s&#x1EBD; thay &#x111;&#x1ED5;i t&#x1B0;&#x1A1;ng lai v&#xE0; gi&#x1EEF; l&#x1EA5;y ng&#x1B0;&#x1EDD;i con g&#xE1;i &#x1EA5;y, &#x111;&#x1EC3; l&#xE0;m vi&#x1EC7;c &#x111;&#xF3;, anh ta quy&#x1EBF;t &#x111;&#x1ECB;nh s&#x1EBD; v&#x1B0;&#x1A1;n l&#xEA;n l&#xE0;m tr&#xF9;m b&#x103;ng &#x111;&#x1EA3;ng kh&#xE9;t ti&#x1EBF;ng nh&#x1EA5;t &#x1EDF; v&#xF9;ng Kantou.<br>\n&#x1EE6;ng h&#x1ED9; b&#x1ECD;n m&#xEC;nh t&#x1EA1;i FB:&#xA0;https://www.facebook.com/EiShunTeam/</p>\n', 'http://truyendep.com/tokyo%e5%8d%8drevengers/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(30, 'Bang chủ đại nhân tìm cách trị hói đầu', 'bang-ch-i-nhan-tim-cach-tr-hoi-u', 'http://truyendep.com/wp-content/uploads/2020/04/bang-chu-dai-nhan-tim-cach-tri-hoi-dau.jpg', '\n<h2>Bang ch&#x1EE7; &#x111;&#x1EA1;i nh&#xE2;n t&#xEC;m c&#xE1;ch tr&#x1ECB; h&#xF3;i &#x111;&#x1EA7;u n&#x1ED9;i dung</h2>\n<p>Ta r&#xF5; r&#xE0;ng anh tu&#x1EA5;n, ti&#xEA;u s&#xE1;i, v&#x1EAD;y m&#xE0;&#xA0;b&#x1ECB; h&#xF3;i. &#x110;&#x1EC3; kh&#xF4;ng b&#x1ECB; giang h&#x1ED3; v&#xE0; bang ch&#xFA;ng xem th&#x1B0;&#x1EDD;ng, ta nh&#x1EA5;t &#x111;&#x1ECB;nh ph&#x1EA3;i t&#xEC;m c&#xE1;ch &#x111;&#x1EC3; m&#x1ECD;c t&#xF3;c!</p>\n', 'http://truyendep.com/bang-chu-dai-nhan-tim-cach-tri-hoi-dau/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(31, 'Nhà Trọ Nhất Khắc', 'nha-tr-nht-khc', 'http://truyendep.com/wp-content/uploads/2020/04/nha-tro-nhat-khac.jpg', '\n<h2>Nh&#xE0; Tr&#x1ECD; Nh&#x1EA5;t Kh&#x1EAF;c n&#x1ED9;i dung</h2>\n<p>Ng&#xE0;y n&#x1EA3;y ng&#xE0;y nay, trong m&#x1ED9;t x&#xF3;m tr&#x1ECD; c&#xF3; t&#xEA;n Nh&#x1EA5;t Kh&#x1EAF;c (Ikkoku), n&#x1A1;i &#x111;&#xF3; c&#xF3; ch&#xE0;ng h&#x1ECD;c tr&#xF2; ngh&#xE8;o bi&#x1EC7;t danh &#x201C;th&#x1EA7;n R&#x1EDB;t&#x201D;, m&#x1ED9;t ti&#x1EC3;u th&#x1B0; sexy, m&#x1ED9;t g&#xE3; k&#x1EF3; qu&#x1EB7;c th&#xED;ch &#x111;&#x1EE5;c t&#x1B0;&#x1EDD;ng d&#xF2;m l&#xE9;n, m&#x1ED9;t b&#x1EE3;m r&#x1B0;&#x1EE3;u t&#x1EED;u l&#x1B0;&#x1EE3;ng v&#xF4; &#x111;&#x1ED1;i s&#x1ED1;ng chung v&#x1EDB;i nhau r&#x1EA5;t h&#xF2;a thu&#x1EAD;n. M&#x1ED9;t ng&#xE0;y n&#x1ECD;, c&#xF3; m&#x1ED9;t c&#xF4; g&#xE1;i &#x111;&#x1EBF;n v&#xE0; t&#x1EF1; x&#x1B0;ng l&#xE0; qu&#x1EA3;n l&#xFD; m&#x1EDB;i cho khu tr&#x1ECD;.<br>\nNg&#x1B0;&#x1EDD;i qu&#x1EA3;n l&#xFD; xinh &#x111;&#x1EB9;p &#x111;&#xE3; khi&#x1EBF;n ch&#xE0;ng h&#x1ECD;c tr&#xF2; ngh&#xE8;o, con r&#x1A1;i c&#x1EE7;a th&#x1EA7;n R&#x1EDB;t, th&#x1EA7;m th&#x1B0;&#x1A1;ng tr&#x1ED9;m nh&#x1EDB;&#x2026; v&#xE0; c&#xE2;u chuy&#x1EC7;n &#x201C;c&#xF3;c gh&#x1EBB; &#x111;&#xF2;i &#x103;n th&#x1ECB;t thi&#xEA;n nga&#x201D; &#x111;&#x1B0;&#x1EE3;c b&#x1EAF;t &#x111;&#x1EA7;u.</p>\n', 'http://truyendep.com/nha-tro-nhat-khac/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(32, 'The Fable', 'the-fable', 'http://truyendep.com/wp-content/uploads/2020/04/the-fable.jpg', '\n<h2>The Fable n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t s&#xE1;t th&#x1EE7; truy&#x1EC1;n thuy&#x1EBF;t chuy&#xEA;n v&#x1EC1; gi&#x1EBF;t ng&#x1B0;&#x1EDD;i c&#x1B0; tr&#xFA; &#x1EDF; m&#x1ED9;t n&#xE0;o &#x111;&#xF3; t&#x1EA1;i Osaka. t&#x1EEB; khi c&#xF2;n r&#x1EA5;t nh&#x1ECF;, &#x111;&#xE3; &#x111;&#x1B0;&#x1EE3;c truy&#x1EC1;n d&#x1EA1;y l&#xE0; ph&#x1EA3;i tu&#xE2;n theo m&#x1EC7;nh l&#x1EC7;nh t&#x1EEB; s&#x1EBF;p l&#x1EDB;n, anh &#x1EA5;y &#x111;&#x1B0;&#x1EE3;c ra l&#x1EC7;nh l&#xE0; ph&#x1EA3;i s&#x1ED1;ng &#x1EDF; Osaka nh&#x1B0; m&#x1ED9;t ng&#x1B0;&#x1EDD;i b&#xEC;nh th&#x1B0;&#x1EDD;ng trong m&#x1ED9;t n&#x103;m theo l&#x1EC7;nh &#xE1;n binh b&#x1EA5;t &#x111;&#x1ED9;ng c&#x1EE7;a boss.</p>\n', 'http://truyendep.com/the-fable/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(33, 'Parasyte Reversi', 'parasyte-reversi', 'http://truyendep.com/wp-content/uploads/2020/04/parasyte-reversi.jpg', '\n<h2>Parasyte Reversi n&#x1ED9;i dung</h2>\n<p>&#x110;&#xE2;y l&#xE0; side story c&#x1EE7;a b&#x1ED9; truy&#x1EC7;n n&#x1ED5;i ti&#x1EBF;ng&#xA0;Parasyte (1988) c&#x1EE7;a t&#xE1;c gi&#x1EA3;&#xA0;Iwaaki&#xA0;Hitoshi.<br>\nC&#xE1;c s&#x1EF1; ki&#x1EC7;n trong b&#x1ED9; n&#xE0;y x&#x1EA3;y ra song song v&#x1EDB;i c&#xE2;u chuy&#x1EC7;n c&#x1EE7;a Shinichi v&#xE0; Migi, v&#xEC; th&#x1EBF;, n&#x1EBF;u mu&#x1ED1;n &#x111;&#x1ECD;c b&#x1ED9; n&#xE0;y th&#xEC; t&#x1ED1;t nh&#x1EA5;t l&#xE0; n&#xEA;n &#x111;&#x1ECD;c l&#x1EA1;i&#xA0;b&#x1ED9; c&#x169;.</p>\n', 'http://truyendep.com/parasyte-reversi/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(34, 'Little Lotus', 'little-lotus', 'http://truyendep.com/wp-content/uploads/2020/04/little-lotus.jpg', '\n<h2>Little Lotus n&#x1ED9;i dung</h2>\n<p>Sakurai&#xA0;shunsuke&#xA0;l&#xE0; nh&#xE2;n v&#x1EAD;t ch&#xED;nh c&#x1EE7;a ch&#xFA;ng ta,&#xF4;ng c&#x1EE7;a main b&#x1ECB; b&#x1EC7;nh n&#xEA;n v&#xE0;o th&#x103;m,nghe n&#xF3;i &#xF4;ng m&#xEC;nh &#x111;&#xE3; t&#x1EEB;ng c&#xF3; con v&#x1EDB;i 1 ng&#x1B0;&#x1EDD;i ph&#x1EE5; n&#x1EEF; &#x1EDF; Vi&#x1EC7;t Nam theo di nguy&#x1EC7;n,main tim &#x111;&#x1EBF;n Vi&#x1EC7;t Nam v&#xE0; g&#x1EB7;p n&#x1EEF; ch&#xED;nh &#x1EDF; &#x111;&#xE2;y&#x2026;..</p>\n', 'http://truyendep.com/little-lotus/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(35, 'Hoenkan Evans no Uso', 'hoenkan-evans-no-uso', 'http://truyendep.com/wp-content/uploads/2020/04/hoenkan-evans-no-uso.jpg', '\n<h2>Hoenkan Evans no Uso n&#x1ED9;i dung</h2>\n<p>Anh c&#x1EA3;nh s&#xE1;t tr&#x1B0;&#x1EDF;ng b&#x1EA5;t h&#x1EA1;nh Elmore Evans &#x111;&#xE3; FA h&#x1A1;n 20 n&#x103;m &#x111;i t&#xEC;m may m&#x1EAF;n trong con &#x111;&#x1B0;&#x1EDD;ng t&#xEC;nh duy&#xEA;n c&#x1EE7;a m&#xEC;nh.</p>\n', 'http://truyendep.com/hoenkan-evans-no-uso/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(36, 'Gia Tộc Điệp Viên Yozakura', 'gia-tc-ip-vien-yozakura', 'http://truyendep.com/wp-content/uploads/2020/04/gia-toc-diep-vien-yozakura.jpg', '\n<h2>Gia T&#x1ED9;c &#x110;i&#x1EC7;p Vi&#xEA;n Yozakura n&#x1ED9;i dung</h2>\n<p>Taiyou Asano l&#xE0; 1 h&#x1ECD;c sinh cao trung g&#x1EB7;p v&#x1EA5;n &#x111;&#x1EC1; trong vi&#x1EC7;c giao ti&#x1EBF;p v&#x1EDB;i m&#x1ECD;i ng&#x1B0;&#x1EDD;i. B&#x1EA1;n th&#x1EDD;i th&#x1A1; &#x1EA5;u c&#x1EE7;a c&#x1EAD;u ta, Mutsumi Yozakura, l&#xE0; ng&#x1B0;&#x1EDD;i duy nh&#x1EA5;t c&#xF3; th&#x1EC3; n&#xF3;i chuy&#x1EC7;n b&#xEC;nh th&#x1B0;&#x1EDD;ng v&#x1EDB;i Taiyou. R&#x1ED3;i 1 ng&#xE0;y c&#x1EAD;u ph&#xE1;t hi&#x1EC7;n ra Mutsumi l&#xE0; th&#xE0;nh vi&#xEA;n c&#x1EE7;a 1 gia &#x111;&#xEC;nh &#x111;i&#x1EC7;p vi&#xEA;n! T&#x1EC7; h&#x1A1;n n&#x1EEF;a, c&#xF4; hi&#x1EC7;n &#x111;ang ph&#x1EA3;i ch&#x1ECB;u s&#x1EF1; qu&#x1EA3;n th&#xFA;c &#x111;&#x1ECB;a ng&#x1EE5;c c&#x1EE7;a anh trai m&#xEC;nh l&#xE0; kyoichiro. Taiyou s&#x1EBD; ph&#x1EA3;i l&#xE0;m g&#xEC; &#x111;&#x1EC3; c&#x1EE9;u Mutsumi?! Nhi&#x1EC7;m v&#x1EE5; b&#x1EA5;t kh&#x1EA3; thi phi&#xEA;n b&#x1EA3;n t&#x1EA5;u h&#xE0;i b&#x1EAF;t &#x111;&#x1EA7;u!</p>\n', 'http://truyendep.com/gia-toc-diep-vien-yozakura/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(37, 'Vua trò chơi Full Màu', 'vua-tro-chi-full-mau', 'http://truyendep.com/wp-content/uploads/2020/04/vua-tro-choi-full-mau.jpg', '\n<h2>Vua tr&#xF2; ch&#x1A1;i Full M&#xE0;u n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t trong nh&#x1EEF;ng b&#x1ED9; truy&#x1EC7;n g&#x1EAF;n li&#x1EC1;n v&#x1EDB;i tu&#x1ED5;i th&#x1A1;&#x2026;nay &#x111;&#xE3; c&#xF3; b&#x1EA3;n full m&#xE0;u</p>\n', 'http://truyendep.com/vua-tro-choi-full-mau/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(38, 'ne0;lation', 'ne0-lation', 'http://truyendep.com/wp-content/uploads/2020/04/ne0lation.jpg', '\n<h2>ne0;lation n&#x1ED9;i dung</h2>\n<p>Nh&#x1EA5;n ph&#xED;m &#x111;&#x1EC3; chinh ph&#x1EE5;c th&#x1EBF; gi&#x1EDB;i !!&#xA0; C&#x1EAD;u h&#x1ECD;c sinh v&#x1EA5;t v&#x1EA3; v&#xEC; tr&#x1EA3; n&#x1EE3; cho ba &#x2013; H&#x1ECD;c sinh chuy&#x1EC3;n tr&#x1B0;&#x1EDD;ng b&#xED; &#x1EA9;n b&#x1EA5;t ng&#x1EDD; xu&#x1EA5;t hi&#x1EC7;n tr&#x1B0;&#x1EDB;c Daigo&#xA0;&#xB7;&#xA0;Hacker thi&#xEA;n t&#xE0;i &#x201C;ne0&#x201D; IQ 191 . Cu&#x1ED9;c g&#x1EB7;p g&#x1EE1; v&#x1EDB;i ch&#xE0;ng trai si&#xEA;u vi&#x1EC7;t, t&#x1EF1; tin, t&#xE1;o t&#x1EE3;n n&#xE0;y &#x111;&#xE3; t&#x1EA1;o n&#xEA;n m&#x1ED9;t s&#x1EF1; thay &#x111;&#x1ED5;i l&#x1EDB;n trong cu&#x1ED9;c &#x111;&#x1EDD;i c&#x1EE7;a Minai! C&#xE2;u chuy&#x1EC7;n v&#x1EC1; ch&#xE0;ng trai ma ph&#xE1;p s&#x1B0; hacking b&#x1EAF;t &#x111;&#x1EA7;u!</p>\n', 'http://truyendep.com/ne0lation/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(39, 'Super Cub', 'super-cub', 'http://truyendep.com/wp-content/uploads/2020/04/super-cub.jpg', '\n<h2>Super Cub n&#x1ED9;i dung</h2>\n<p>V&#xE0;o &#x111;&#x1EA7;u m&#xF9;a h&#xE8; n&#x103;m 2 trung h&#x1ECD;c, m&#x1EB9; c&#x1EE7;a Koguma &#x111;&#x1ED9;t nhi&#xEA;n r&#x1EDD;i &#x111;i, ch&#x1EC9; &#x111;&#x1EC3; l&#x1EA1;i m&#x1ED9;t d&#xF2;ng ch&#x1EEF; &#x201C;T&#x1EA1;m bi&#x1EC7;t&#x201D;. C&#xF4; &#x1EDF; m&#x1ED9;t m&#xEC;nh, kh&#xF4;ng c&#xF3; b&#x1ED1; m&#x1EB9;, kh&#xF4;ng b&#x1EA1;n b&#xE8;, kh&#xF4;ng c&#xF3; s&#x1EDF; th&#xED;ch. C&#xF4; &#xE2;m th&#x1EA7;m than th&#x1EDF;, &#x201C;m&#xEC;nh kh&#xF4;ng c&#xF3; g&#xEC; c&#x1EA3;.&#x201D; Nh&#x1B0;ng m&#x1ED9;t cu&#x1ED9;c g&#x1EB7;p g&#x1EE1; t&#xEC;nh c&#x1EDD; d&#x1EAB;n &#x111;&#x1EBF;n vi&#x1EC7;c c&#xF4; mua m&#x1ED9;t chi&#x1EBF;c Honda Super Cub c&#xF3; l&#x1ECB;ch s&#x1EED; &#x111;&#xE1;ng lo ng&#x1EA1;i, v&#xE0; m&#x1ED9;t cu&#x1ED9;c s&#x1ED1;ng m&#x1EDB;i &#x111;&#x1ED9;t nhi&#xEA;n m&#x1EDF; ra v&#x1EDB;i c&#xF4;.</p>\n', 'http://truyendep.com/super-cub/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(40, 'Ragna Crimson', 'ragna-crimson', 'http://truyendep.com/wp-content/uploads/2020/04/ragna-crimson.jpg', '\n<h2>Ragna Crimson n&#x1ED9;i dung</h2>\n<p>&#x111;&#x1EA1;i kh&#xE1;i n&#x1ED9;i dung l&#xE0; ns v&#x1EC1; m&#x1ED9;t thanh ni&#xEA;n &#x111;&#x1ED3;ng h&#xE0;nh c&#xF9;ng b&#xE9; loli ( con n&#xE0;y m&#x1EA1;nh vl ra &#x1EA5;y) nh&#x1B0;ng &#x111;&#xE9;o ph&#x1EA3;i, th&#x1EB1;ng main n&#xF3; c&#xF2;n g&#x1EA5;p m&#x1EA5;y l&#x1EA7;n :))) kh&#xE1;c saitama m&#x1ED9;t t&#xED; thay v&#xEC; &#x111;&#x1EA5;m thg &#x1EA5;y ch&#x1EC9; ch&#x1EA1;m m&#x1ED9;t c&#xE1;i l&#xE0; ti&#xEA;u con r&#x1ED3;ngm&#xE0; m&#x1EDB;i l&#xE0; c&#xF3; romance n&#x1EEF;a nh&#xE9; :3&#xA0;the best of manga</p>\n', 'http://truyendep.com/ragna-crimson/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(41, 'Ikigami', 'ikigami', 'http://truyendep.com/wp-content/uploads/2020/04/ikigami.jpg', '\n<h2>Ikigami n&#x1ED9;i dung</h2>\n<p>&#x110;&#x1EC3; &#x111;&#x1EA3;m b&#x1EA3;o s&#x1EF1; an b&#xEC;nh v&#xE0; th&#x1ECB;nh v&#x1B0;&#x1EE3;ng, c&#xE1;c nh&#xE0; l&#xE3;nh &#x111;&#x1EA1;o m&#x1ED9;t &#x111;&#x1EA5;t n&#x1B0;&#x1EDB;c &#x111;&#xE3; ban h&#xE0;nh m&#x1ED9;t &#x111;&#x1EA1;o lu&#x1EAD;t &#x111;&#x1EB7;c bi&#x1EC7;t, qua &#x111;&#xF3;, t&#x1EA5;t c&#x1EA3; tr&#x1EBB; em khi &#x111;&#x1EBF;n tu&#x1ED5;i &#x111;i h&#x1ECD;c, &#x111;&#x1EC1;u s&#x1EBD; &#x111;&#x1B0;&#x1EE3;c ti&#xEA;m m&#x1ED9;t lo&#x1EA1;i v&#x1EAF;c-xin v&#xE0;o ng&#x1B0;&#x1EDD;i. M&#x1ED9;t trong s&#x1ED1; 1000 tr&#x1EBB; em s&#x1EBD; c&#xF3; m&#x1ED9;t ng&#x1B0;&#x1EDD;i l&#xE3;nh m&#x169;i v&#x1EAF;c-xin &#x111;&#x1EB7;c bi&#x1EC7;t, v&#xE0; ng&#x1B0;&#x1EDD;i n&#xE0;y n&#xE0;y s&#x1EBD; ch&#x1EBF;t v&#xE0;o m&#x1ED9;t ng&#xE0;y gi&#x1EDD; nh&#x1EA5;t &#x111;&#x1ECB;nh khi &#x111;ang &#x1EDF; &#x111;&#x1ED9; tu&#x1ED5;i 18-24. C&#xE2;u chuy&#x1EC7;n l&#xE0; h&#xE0;nh tr&#xEC;nh c&#x1EE7;a Kengo Fujimoto &#x2013; m&#x1ED9;t trong nh&#x1EEF;ng nh&#xE2;n vi&#xEA;n c&#x1EE7;a ch&#xED;nh ph&#x1EE7; c&#xF3; nhi&#x1EC7;m v&#x1EE5; ph&#xE2;n ph&#x1ED1;i Ikigami &#x2013; nh&#x1EEF;ng t&#x1EDD; gi&#x1EA5;y b&#xE1;o t&#x1EED; &#x111;&#x1B0;&#x1EE3;c g&#x1EED;i &#x111;&#x1EBF;n tay n&#x1EA1;n nh&#xE2;n &#x111;&#xFA;ng 24 gi&#x1EDD; tr&#x1B0;&#x1EDB;c khi h&#x1ECD; t&#x1EEB; gi&#xE3; cu&#x1ED9;c &#x111;&#x1EDD;i.</p>\n', 'http://truyendep.com/ikigami/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(42, 'Again!!', 'again', 'http://truyendep.com/wp-content/uploads/2020/04/again.jpg', '\n<h2>Again!! n&#x1ED9;i dung</h2>\n<p>Sau 3 n&#x103;m trung h&#x1ECD;c, cu&#x1ED1;i c&#xF9;ng Imamura Kinichirou c&#x169;ng t&#x1ED1;t nghi&#x1EC7;p. Trong su&#x1ED1;t 3 n&#x103;m &#x1EA5;y, c&#x1EAD;u kh&#xF4;ng h&#x1EC1; c&#xF3; n&#x1ED5;i m&#x1ED9;t ng&#x1B0;&#x1EDD;i b&#x1EA1;n v&#xEC; v&#x1EBB; ngo&#xE0;i &#x201C;t&#x1ED9;i ph&#x1EA1;m&#x201D; c&#x1EE7;a m&#xEC;nh. Nh&#xEC;n l&#x1EA1;i nh&#x1EEF;ng ng&#xE0;y th&#xE1;ng &#x111;&#xE3; qua, trong l&#xF2;ng c&#x1EAD;u lu&#xF4;n day d&#x1EE9;t v&#x1EC1; l&#x1EDD;i m&#x1EDD;i c&#x1EE7;a m&#x1ED9;t c&#xF4; g&#xE1;i v&#xE0;o &#x111;&#x1ED9;i c&#x1ED5; v&#x169; m&#xE0; c&#x1EAD;u &#x111;&#xE3; t&#x1EEB; ch&#x1ED1;i. C&#x1EAD;u lu&#xF4;n b&#x103;n kho&#x103;n r&#x1EB1;ng: &#x201C;N&#x1EBF;u m&#xEC;nh c&#xF3; c&#xE2;u tr&#x1EA3; l&#x1EDD;i kh&#xE1;c th&#xEC;&#x2026;.&#x201D;. Tr&#x1B0;&#x1EDB;c khi r&#x1EDD;i tr&#x1B0;&#x1EDD;ng, c&#x1EAD;u mu&#x1ED1;n nh&#xEC;n l&#x1EA1;i ph&#xF2;ng h&#x1ECD;c c&#x169; &#x111;&#xE3; b&#x1ECB; b&#x1ECF; hoang d&#xE0;nh cho &#x111;&#x1ED9;i c&#x1ED5; v&#x169; n&#xEA;n l&#xE9;n tr&#xE8;o v&#xE0;o. &#x110;&#xFA;ng l&#xFA;c &#x111;&#xF3;, c&#xF4; n&#xE0;ng Fujieda Aki &#x111;ang &#x111;&#x1EE3;i ng&#x1B0;&#x1EDD;i y&#xEA;u &#x111;&#xE3; ph&#xE1;t hi&#x1EC7;n ra, li&#x1EC1;n cu&#x1ED1;ng cu&#x1ED3;ng ch&#x1EA1;y &#x111;i v&#xEC; ngh&#x129; c&#x1EAD;u &#x111;ang l&#xE0;m &#x111;i&#x1EC1;u m&#x1EDD; &#xE1;m.C&#x1EA3; 2 c&#xF9;ng ng&#xE3; xu&#x1ED1;ng c&#x1EA7;u thang v&#xE0; linh h&#x1ED3;n c&#xF9;ng &#x111;&#x1B0;&#x1EE3;c &#x111;&#x1B0;a tr&#x1EDF; l&#x1EA1;i 3 n&#x103;m tr&#x1B0;&#x1EDB;c, khi h&#x1ECD; c&#xF2;n l&#xE0; h&#x1ECD;c sinh n&#x103;m 1. Li&#x1EC7;u Imamura c&#xF3; th&#x1EC3; s&#x1EED;a ch&#x1EEF;a l&#x1EA1;i nh&#x1EEF;ng l&#x1ED7;i l&#x1EA7;m c&#x1EE7;a m&#xEC;nh, v&#xE0; thay &#x111;&#x1ED5;i cu&#x1ED9;c s&#x1ED1;ng h&#x1ECD;c sinh trung h&#x1ECD;c t&#x1EBB; nh&#x1EA1;t nh&#xE0;m ch&#xE1;n kh&#xF4;ng? M&#x1ED9;t l&#x1EA7;n n&#x1EEF;a, c&#x1EAD;u l&#x1EA1;i b&#x1EAF;t &#x111;&#x1EA7;u h&#xE0;nh tr&#xEC;nh v&#x1EC1; qu&#xE1; kh&#x1EE9; &#x111;&#x1EC3; thay &#x111;&#x1ED5;i s&#x1ED1; ph&#x1EAD;n hi&#x1EC7;n t&#x1EA1;i.</p>\n', 'http://truyendep.com/again/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(43, 'Tonari no Seki no Satou-san', 'tonari-no-seki-no-satou-san', 'http://truyendep.com/wp-content/uploads/2020/04/tonari-no-seki-no-satou-san.jpg', '\n<h2>Tonari no Seki no Satou-san n&#x1ED9;i dung</h2>\n<p>Yamaguchi m&#x1ED9;t ch&#xE0;ng trai th&#xF4;ng minh, ng&#x1ED3;i c&#x1EA1;nh c&#x1EAD;u l&#xE0; satou-san ng&#x1B0;&#x1EDD;i ch&#x1EB3;ng h&#x1EC1; gi&#x1ECF;i b&#x1EA5;t k&#xEC; &#x111;i&#x1EC1;u g&#xEC; nh&#x1B0;ng nh&#x1EEF;ng h&#xE0;nh &#x111;&#x1ED9;ng nh&#x1ECF; v&#xE0; s&#x1EF1; &#xE2;n c&#x1EA7;n c&#x1EE7;a c&#xF4; t&#x1EEB; t&#x1EEB; thay &#x111;&#x1ED5;i c&#x1EA3;m x&#xFA;c c&#x1EE7;a Yamaguchi<br>\nB&#x1ED9; truy&#x1EC7;n d&#x1EF1;a theo b&#x1EA3;n LN c&#xF9;ng t&#xEA;n &#x111;&#x1B0;&#x1EE3;c xu&#x1EA5;t b&#x1EA3;n n&#x103;m 2018</p>\n', 'http://truyendep.com/tonari-no-seki-no-satou-san/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(44, 'Atula – Tây du tiền truyện', 'atula-tay-du-tin-truyn', 'http://truyendep.com/wp-content/uploads/2020/04/Atula.jpg', '\n<h2>Atula &#x2013; T&#xE2;y du ti&#x1EC1;n truy&#x1EC7;n n&#x1ED9;i dung</h2>\n<p>Atula &#x2013; T&#xE2;y du ti&#x1EC1;n truy&#x1EC7;n l&#xE0; ph&#x1EA7;n ngo&#x1EA1;i truy&#x1EC7;n b&#x1ED9; truy&#x1EC7;n tranh T&#xE2;y du c&#x1EE7;a 2 t&#xE1;c gi&#x1EA3; Huy &#x2013; H&#xF2;a l&#xE0; ph&#x1EA7;n ti&#x1EBF;p theo sau khi k&#x1EBF;t th&#xFA;c b&#x1ED9; Tam qu&#x1ED1;c ch&#xED; d&#x1ECB;.</p>\n<p>&#x110;&#x1ECD;c truy&#x1EC7;n tranh Atula &#x2013; T&#xE2;y du ti&#x1EC1;n truy&#x1EC7;n ti&#x1EBF;ng Vi&#x1EC7;t chap m&#x1EDB;i nh&#x1EA5;t t&#x1EA1;i website &#x111;&#x1ECD;c truy&#x1EC7;n tranh manga online hay nh&#x1EA5;t Mangak.info</p>\n', 'http://truyendep.com/atula-tay-du-tien-truyen/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(45, 'Usotoki Rhetoric', 'usotoki-rhetoric', 'http://truyendep.com/wp-content/uploads/2020/03/usotoki-rhetoric.jpg', '\n<h2>Usotoki Rhetoric n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t c&#xF4; g&#xE1;i c&#xF3; kh&#x1EA3; n&#x103;ng tr&#x1EDD;i ph&#xFA; nghe th&#x1EA5;y nh&#x1EEF;ng l&#x1EDD;i n&#xF3;i d&#x1ED1;i. Trong khi &#x111;ang kh&#x1ED5; s&#x1EDF; v&#xEC; &#x111;i&#x1EC1;u n&#xE0;y, c&#xF4; &#x111;&#xE3; g&#x1EB7;p ph&#x1EA3;i m&#x1ED9;t anh ch&#xE0;ng th&#xE1;m t&#x1EED; k&#xEC; l&#x1EA1;.<br>\nC&#xE2;u chuy&#x1EC7;n c&#x1EE7;a h&#x1ECD; s&#x1EBD; ti&#x1EBF;p t&#x1EE5;c nh&#x1B0; th&#x1EBF; n&#xE0;o?</p>\n', 'http://truyendep.com/usotoki-rhetoric/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(46, 'Khu Trọ Quỷ Ám', 'khu-tr-qu-am', 'http://truyendep.com/wp-content/uploads/2020/03/khu-tro-quy-am.jpg', '\n<h2>Khu Tr&#x1ECD; Qu&#x1EF7; &#xC1;m n&#x1ED9;i dung</h2>\n<p>M&#x1EA5;y ng&#xE0;y g&#x1EA7;n &#x111;&#xE2;y, &#x1EDF; c&#x103;n h&#x1ED9; b&#xEA;n d&#x1B0;&#x1EDB;i c&#x1EE9; c&#xF3; m&#x1ED9;t m&#xF9;i th&#x1ED1;i r&#x1EEF;a k&#x1EF3; l&#x1EA1; b&#x1ED1;c l&#xEA;n. V&#xE0;i h&#xF4;m sau, th&#x1EB1;ng b&#x1EA1;n th&#xE2;n c&#x1EE7;a t&#xF4;i t&#x1EF1; d&#x1B0;ng m&#x1EA5;t t&#xED;ch. C&#x1EA3; c&#xF4; g&#xE1;i s&#x1ED1;ng trong c&#x103;n h&#x1ED9; &#x111;&#xF3; c&#x169;ng v&#x1EAD;y. Ti&#x1EBF;p theo s&#x1EBD; &#x111;&#x1EBF;n l&#x1B0;&#x1EE3;t ai &#x111;&#xE2;y&#x2026;?</p>\n', 'http://truyendep.com/khu-tro-quy-am/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:10'),
(47, 'Issak', 'issak', 'http://truyendep.com/wp-content/uploads/2020/03/issak.jpg', '\n<h2>Issak n&#x1ED9;i dung</h2>\n<p>V&#xE0;o th&#x1EBF; k&#x1EF7; 17, &#x110;&#x1EBF; ch&#x1EBF;&#xA0;La M&#xE3; Th&#x1EA7;n th&#xE1;nh&#xA0;&#x111;&#xE3; b&#x1ECB; t&#xE0;n ph&#xE1; b&#x1EDF;i cu&#x1ED9;c&#xA0;Chi&#x1EBF;n tranh Ba m&#x1B0;&#x1A1;i n&#x103;m. Gi&#x1EEF;a s&#x1EF1; h&#x1ED7;n lo&#x1EA1;n n&#xE0;y xu&#x1EA5;t hi&#x1EC7;n m&#x1ED9;t l&#xED;nh &#x111;&#xE1;nh thu&#xEA; Nh&#x1EAD;t B&#x1EA3;n&#xA0;t&#xEA;n l&#xE0; Isaak. Tr&#x1EAD;n chi&#x1EBF;n &#xE1;c li&#x1EC7;t c&#x1EE7;a h&#x1EAF;n ta&#xA0;b&#x1EAF;t &#x111;&#x1EA7;u.</p>\n', 'http://truyendep.com/issak/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(48, 'Kamitachi Ni Hirowareta Otoko', 'kamitachi-ni-hirowareta-otoko', 'http://truyendep.com/wp-content/uploads/2020/03/kamitachi-ni-hirowareta-otoko.jpg', '\n<h2>Kamitachi Ni Hirowareta Otoko n&#x1ED9;i dung</h2>\n<p>Ryouma Takuma, m&#x1ED9;t ng&#x1B0;&#x1EDD;i &#x111;&#xE0;n &#xF4;ng 39 tu&#x1ED5;i v&#x1EDB;i qu&#xE1; kh&#x1EE9; b&#x1ECB; che gi&#x1EA5;u, t&#x1EC9;nh d&#x1EAD;y trong m&#x1ED9;t c&#x103;n ph&#xF2;ng l&#x1EA1; m&#xE0;u tr&#x1EAF;ng. Nh&#x1EEF;ng v&#x1ECB; th&#x1EA7;n b&#x1EA3;o r&#x1EB1;ng anh &#x111;&#xE3; ch&#x1EBF;t v&#xE0; h&#x1ECD; s&#x1EBD; g&#x1EED;i linh h&#x1ED3;n anh t&#x1EDB;i m&#x1ED9;t th&#x1EBF; gi&#x1EDB;i kh&#xE1;c, n&#x1A1;i m&#xE0; ph&#xE9;p thu&#x1EAD;t t&#x1ED3;n t&#x1EA1;i. S&#x1ED1;ng m&#x1ED9;t m&#xEC;nh trong v&#xF2;ng 3 n&#x103;m, linh h&#x1ED3;n ng&#x1B0;&#x1EDD;i ch&#x1A1;i c&#x1EE7;a anh m&#x1EA5;t d&#x1EA7;n tri gi&#xE1;c v&#xE0; b&#x1EAF;t &#x111;&#x1EA7;u h&#x1B0;&#x1EDB;ng t&#x1EDB;i nh&#x1EEF;ng con &#x111;&#x1B0;&#x1EDD;ng &#x111;i&#xEA;n r&#x1ED3;.</p>\n', 'http://truyendep.com/kamitachi-ni-hirowareta-otoko/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(49, 'Midashitai Giya-san to Midarenai Tadamichi', 'midashitai-giya-san-to-midarenai-tadamichi', 'http://truyendep.com/wp-content/uploads/2020/03/midashitai-giya-san-to-midarenai-tadamichi.jpg', '\n<h2>Midashitai Giya-san to Midarenai Tadamichi n&#x1ED9;i dung</h2>\n<p>Sao&#x111;&#x1ECF; nghi&#xEA;m t&#xFA;c v&#xE0; cu&#x1ED9;c s&#x1ED1;ng h&#x1EB1;ng ng&#xE0;y</p>\n', 'http://truyendep.com/midashitai-giya-san-to-midarenai-tadamichi/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(50, 'Colorless', 'colorless', 'http://truyendep.com/wp-content/uploads/2020/03/colorless.jpeg', '\n<h2>Colorless n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t tr&#x1EAD;n si&#xEA;u b&#xE3;o M&#x1EB7;t tr&#x1EDD;i &#x111;&#xE3; khi&#x1EBF;n cho Tr&#xE1;i &#x110;&#x1EA5;t m&#x1EA5;t &#x111;i m&#xE0;u s&#x1EAF;c c&#x1EE7;a ri&#xEA;ng n&#xF3;. Lo&#xE0;i ng&#x1B0;&#x1EDD;i tr&#x1EDF; n&#xEA;n bi&#x1EBF;n d&#x1EA1;ng, d&#xE2;n s&#x1ED1; suy gi&#x1EA3;m. Ch&#xEC;a kh&#xF3;a &#x111;&#x1EC3; &#x111;o&#x1EA1;t l&#x1EA1;i th&#x1EBF; gi&#x1EDB;i ng&#xE0;y n&#xE0;o n&#x1EB1;m trong th&#x1EE9; s&#x1EE9;c m&#x1EA1;nh ti&#x1EC1;m &#x1EA9;n trong &quot;s&#x1EAF;c m&#xE0;u&quot; v&#xE0; m&#x1ED9;t &quot;c&#xF4; g&#xE1;i&quot;. Bi&#x1EBF;t &#x111;&#x1B0;&#x1EE3;c r&#x1EB1;ng ch&#xFA;t t&#xE0;n d&#x1B0; c&#x1EE7;a s&#x1EAF;c m&#xE0;u n&#x1EAF;m gi&#x1EEF; m&#x1ED9;t s&#x1EE9;c m&#x1EA1;nh v&#xF4; bi&#xEA;n, Avidia, ng&#x1B0;&#x1EDD;i &#x111;ang th&#x1EF1;c hi&#x1EC7;n m&#x1ED9;t s&#x1ED1; nghi&#xEA;n c&#x1EE9;u v&#xE0; b&#x1EA3;o v&#x1EC7; m&#x1ED9;t c&#xF4; g&#xE1;i t&#xEA;n Chie, s&#x1EED; d&#x1EE5;ng s&#x1EAF;c m&#xE0;u nh&#x1EB1;m ph&#xE1;t tri&#x1EC3;n s&#x1EE9;c m&#x1EA1;nh c&#x1EE7;a ri&#xEA;ng m&#xEC;nh, &#x111;&#x1EC3; r&#x1ED3;i &#x111;&#x1EA9;y ch&#xED;nh m&#xEC;nh v&#xE0;o cu&#x1ED9;c chi&#x1EBF;n v&#x1EDB;i l&#x169; Cult.</p>\n', 'http://truyendep.com/colorless/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(51, 'Thế giới xa lạ', 'th-gii-xa-l', 'http://truyendep.com/wp-content/uploads/2020/03/the-gioi-xa-la.jpg', '\n<h2>Th&#x1EBF; gi&#x1EDB;i xa l&#x1EA1; n&#x1ED9;i dung</h2>\n<p>X&#x1B0;a nay, nhi&#x1EC1;u v&#x1EAD;t ph&#x1EA9;m k&#x1EF3; d&#x1ECB; c&#xF3; thu&#x1ED9;c t&#xED;nh th&#x1EA7;n k&#x1EF3; v&#xF4; s&#x1ED1; k&#x1EC3;, ng&#x1B0;&#x1EDD;i x&#x1B0;a g&#x1ECD;i l&#xE0; Th&#x1EA7;n V&#x1EAD;t. Ng&#x1B0;&#x1EDD;i hi&#x1EC7;n &#x111;&#x1EA1;i b&#xE2;y gi&#x1EDD; g&#x1ECD;i l&#xE0; D&#x1ECB; B&#x1EA3;o. V&#x1EA1;t hoa thi&#xEA;n b&#x1EA3;o, ch&#x1EA5;n c&#x1ED5; th&#x1B0;&#x1EDB;c kim, s&#xE2;m la v&#x1EA1;n t&#x1B0;&#x1EE3;ng, quang qu&#xE1;i l&#x1EE5;c li.B&#x1EA1;n c&#xF3; mu&#x1ED1;n theo La Th&#x1EA7;n v&#xE0; Chu M&#x1EE5;c c&#xF9;ng v&#xE0;o th&#x1EBF; gi&#x1EDB;i xa l&#x1EA1;?</p>\n', 'http://truyendep.com/the-gioi-xa-la/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11');
