(52, 'Nyankees', 'nyankees', 'http://truyendep.com/wp-content/uploads/2020/03/nyankees.jpg', '\n<h2>Nyankees n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t c&#xE2;u truy&#x1EC7;n mi&#xEA;u t&#x1EA3; nh&#x1EEF;ng ch&#xFA; m&#xE8;o lang thang nh&#x1B0; &#x111;&#xE1;m yankees, s&#x1EB5;n s&#xE0;ng lao v&#xE0;o &#x1EA9;u &#x111;&#x1EA3; tr&#xEA;n nh&#x1EEF;ng &#x111;&#x1B0;&#x1EDD;ng ph&#x1ED1; c&#x1EE7;a th&#xE0;nh th&#x1ECB; b&#x1EA5;t k&#x1EF3; l&#xFA;c n&#xE0;o</p>\n', 'http://truyendep.com/nyankees/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(53, '100 Điều Muốn Làm Trước Khi Chết', '100-iu-mun-lam-trc-khi-cht', 'http://truyendep.com/wp-content/uploads/2020/03/100-dieu-muon-lam-truoc-khi-chet.jpg', '\n<h2>100 &#x110;i&#x1EC1;u Mu&#x1ED1;n L&#xE0;m Tr&#x1B0;&#x1EDB;c Khi Ch&#x1EBF;t n&#x1ED9;i dung</h2>\n<p>Akira v&#x1ED1;n l&#xE0; nh&#xE2;n vi&#xEA;n c&#x1EE7;a 1 c&#xF4;ng ty &#x111;en chuy&#xEA;n b&#xF3;c l&#x1ED9;t ng&#x1B0;&#x1EDD;i lao &#x111;&#x1ED9;ng trong su&#x1ED1;t 3 n&#x103;m. Ki&#x1EC7;t qu&#x1EC7; v&#x1EC1; c&#x1EA3; m&#x1EB7;t tinh th&#x1EA7;n l&#x1EAB;n th&#x1EC3; ch&#x1EA5;t cho &#x111;&#x1EBF;n m&#x1ED9;t ng&#xE0;y c&#x1EAD;u ph&#xE1;t hi&#x1EC7;n ra r&#x1EB1;ng &#x111;&#x1EA1;i d&#x1ECB;ch Zombie &#x111;&#xE3; x&#xE2;m chi&#x1EBF;m to&#xE0;n th&#x1EBF; gi&#x1EDB;i. Li&#x1EC7;u anh nh&#xE2;n v&#x1EAD;t ch&#xED;nh c&#x1EE7;a ch&#xFA;ng ta s&#x1EBD; sinh t&#x1ED3;n trong c&#xE1;i th&#x1EBF; gi&#x1EDB;i &#x201C;&#x111;&#x1ECB;a ng&#x1EE5;c&#x201D; n&#xE0;y nh&#x1B0; th&#x1EBF; n&#xE0;o.</p>\n', 'http://truyendep.com/100-dieu-muon-lam-truoc-khi-chet/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(54, 'Nhất ăn tất', 'nht-n-tt', 'http://truyendep.com/wp-content/uploads/2020/03/nhat-an-tat.jpg', '\n<h2>Nh&#x1EA5;t &#x103;n t&#x1EA5;t n&#x1ED9;i dung</h2>\n<p>Truy&#x1EC7;n &#xE9;o nh&#x1B0; c&#xE1;i t&#xEA;n m&#xEC;nh &#x111;&#x1EB7;t cho n&#xF3; &#x111;&#xE2;u. &#x201C;k&#x1EBB; chi&#x1EBF;n th&#x1EAF;ng s&#x1EBD; c&#xF3; t&#x1EA5;t c&#x1EA3;&#x201D;. c&#xE2;u chuy&#x1EC7;n xoay quanh m&#x1ED9;t nh&#xE2;n v&#x1EAD;t gi&#xE0;u c&#xF3; m&#x1EDB;i n&#x1ED5;i nh&#x1EDD; t&#xE0;i tr&#xED; c&#x1EE7;a b&#x1EA3;n th&#xE2;n. anh ta b&#x1ECB; m&#x1ED9;t t&#x1ED5; ch&#x1EE9;c b&#x1EAF;t c&#xF3;c v&#xE0; ph&#x1EAB;u thu&#x1EAD;t con chip l&#xEA;n ng&#x1B0;&#x1EDD;i. truy&#x1EC7;n l&#x1ED9;t t&#x1EA3; l&#x1EA1;i h&#xE0;nh tr&#xEC;nh tr&#x1EA3; th&#xF9; c&#x1EE7;a anh ta cho c&#xE1;i t&#x1ED5; ch&#x1EE9;c &#x111;&#xE3; bi&#x1EBF;n m&#xEC;nh th&#xE0;nh nh&#x1B0; v&#x1EAD;y. &#x111;&#x1EA5;y l&#xE0; theo &#xFD; c&#x1EE7;a m&#xEC;nh th&#xF4;i, c&#xF2;n l&#x1EA1;i n&#x1ED9;i dung th&#x1EBF; n&#xE0;o m&#xEC;nh &#xE9;o bi&#x1EBF;t :(. k&#xED; t&#xEA;n geminikun96 Xem th&#xEA;m</p>\n', 'http://truyendep.com/nhat-an-tat/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(55, 'Quái Thú', 'quai-thu', 'http://truyendep.com/wp-content/uploads/2020/02/quai-thu.jpg', '\n<h2>Qu&#xE1;i Th&#xFA; n&#x1ED9;i dung</h2>\n<p>Kazato c&#xF9;ng 6 ng&#x1B0;&#x1EDD;i b&#x1EA1;n h&#x1ECD;c c&#x1EA5;p hai v&#x1EDB;i &#x111;&#x1EE7; ng&#xE0;nh ngh&#x1EC1; c&#xF9;ng &#x111;&#x1EBF;n ngh&#x1EC9; m&#xE1;t t&#x1EA1;i m&#x1ED9;t h&#xF2;n &#x111;&#x1EA3;o ph&#xED;a nam t&#x1EAD;n h&#x1B0;&#x1EDF;ng k&#x1EF3; ngh&#x1EC9; c&#xF9;ng nhau. &#x110;&#xEA;m n&#x1ECD;, s&#xE1;u ng&#x1B0;&#x1EDD;i l&#xE1;i xe d&#x1ECD;c bi&#x1EC3;n th&#xEC; b&#x1EAF;t g&#x1EB7;p m&#x1ED9;t s&#x1ED1; sinh v&#x1EAD;t ch&#x1B0;a t&#x1EEB;ng g&#x1EB7;p. Ngay sau &#x111;&#xF3;, m&#x1ED9;t &#xE1;nh s&#xE1;ng ch&#xF3;i lo&#xE0; chi&#x1EBF;u t&#x1EDB;i v&#xE0; h&#x1ECD; b&#x1ECB; bao v&#xE2;y b&#x1EDF;i m&#x1ED9;t nh&#xF3;m v&#x169; trang b&#xED; &#x1EA9;n, li&#x1EC7;u r&#x1EB1;ng h&#x1ECD; c&#xF3; th&#x1EC3; an to&#xE0;n v&#x1EC1; &#x111;&#x1B0;&#x1EE3;c nh&#xE0;&#x2026;!?</p>\n', 'http://truyendep.com/quai-thu/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(56, 'Memesis', 'memesis', 'http://truyendep.com/wp-content/uploads/2020/02/memesis.jpg', '\n<h2>Memesis n&#x1ED9;i dung</h2>\n<p>Tong m&#x1ED9;t th&#x1EBF; gi&#x1EDB;i gi&#x1EA3; t&#x1B0;&#x1EDF;ng, n&#x1A1;i qu&#xE1;i v&#x1EAD;t c&#xF2;n xu&#x1EA5;t hi&#x1EC7;n &#x111;&#x1EA7;y r&#x1EAB;y tr&#xEA;n m&#x1EB7;t &#x111;&#x1EA5;t, t&#x1ED5; &#x111;&#x1ED9;i anh h&#xF9;ng g&#x1ED3;m Leon, Ash, Kijira c&#xF9;ng nhau du h&#xE0;nh v&#xE0; ti&#xEA;u di&#x1EC7;t qu&#xE1;i v&#x1EAD;t. Nh&#x1B0;ng Leon &#x111;&#xE3; b&#x1ECF; r&#x1A1;i hai ng&#x1B0;&#x1EDD;i h&#x1ECD; &#x111;&#x1EC3; c&#xF3; th&#x1EC3; &#x111;i c&#x169;ng v&#x1EDB;i hai c&#xF4; g&#xE1;i d&#x1EC5; th&#x1B0;&#x1A1;ng kh&#xE1;c. Ash v&#xE0; Kijira kh&#x1EAF;c s&#xE2;u trong l&#xF2;ng l&#x1EDD;i th&#x1EC1;, t&#x1EEB; ngu&#x1ED3;n g&#x1ED1;c c&#x1EE7;a s&#x1EF1; ghen t&#x1EE9;c, r&#x1EB1;ng s&#x1EBD; v&#x1B0;&#x1EE3;t m&#x1EB7;t Leon c&#x1EA3; vi&#x1EC7;c gi&#x1EBF;t qu&#xE1;i v&#xE0; h&#xFA;t g&#xE1;i.</p>\n', 'http://truyendep.com/memesis/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(57, 'Yêu cầu khẩn cấp: Cách nuôi một con rồng bị bỏ rơi !', 'yeu-cu-khn-cp-cach-nuoi-mt-con-rng-b-b-ri', 'http://truyendep.com/wp-content/uploads/2020/02/yeu-cau-khan-cap-cach-nuoi-mot-con-rong-bi-bo-roi.jpg', '\n<h2>Y&#xEA;u c&#x1EA7;u kh&#x1EA9;n c&#x1EA5;p: C&#xE1;ch nu&#xF4;i m&#x1ED9;t con r&#x1ED3;ng b&#x1ECB; b&#x1ECF; r&#x1A1;i ! n&#x1ED9;i dung</h2>\n<p>N&#x1ED9;i dung : M&#x1ED9;t h&#x1ECD;c sinh trung h&#x1ECD;c ho&#xE0;n to&#xE0;n b&#xEC;nh th&#x1B0;&#x1EDD;ng v&#x1EDB;i &#x111;i&#x1EC3;m t&#x1ED1;t duy nh&#x1EA5;t l&#xE0; s&#x1EF1; d&#x1EBB;o dai, Tetsu. M&#x1ED9;t con th&#x1EB1;n l&#x1EB1;n anh ta nh&#x1EB7;t &#x111;&#x1B0;&#x1EE3;c m&#x1ED9;t ng&#xE0;y, h&#xF3;a ra l&#xE0; m&#x1ED9;t con r&#x1ED3;ng si&#xEA;u hi&#x1EBF;m!? Kh&#xF4;ng bi&#x1EBF;t nu&#xF4;i r&#x1ED3;ng, anh quay sang internet. Tuy nhi&#xEA;n, cu&#x1ED9;c &#x111;i b&#x1ED9; c&#x1EE7;a anh v&#x1EDB;i con r&#x1ED3;ng si&#xEA;u hi&#x1EBF;m c&#x1EE7;a m&#xEC;nh l&#xE0; m&#x1ED9;t ch&#x1EE7; &#x111;&#x1EC1; th&#x1ECB;nh h&#xE0;nh. Cu&#x1ED9;c s&#x1ED1;ng c&#x1EE7;a anh ta s&#x1EBD; tr&#x1EDF; n&#xEA;n h&#x1ED7;n lo&#x1EA1;n nh&#x1B0; th&#x1EBF; n&#xE0;o &#x111;&#xE2;y &#x2026;? &#x110;&#xE2;y l&#xE0; manga chuy&#x1EC3;n th&#x1EC3; &#x111;&#x1B0;&#x1EE3;c ch&#x1EDD; &#x111;&#x1EE3;i t&#x1EEB; l&#xE2;u c&#x1EE7;a b&#x1ED9; ti&#x1EC3;u thuy&#x1EBF;t si&#xEA;u n&#x1ED5;i ti&#x1EBF;ng !!</p>\n', 'http://truyendep.com/yeu-cau-khan-cap-cach-nuoi-mot-con-rong-bi-bo-roi/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(58, 'Yuutousei to Himitsu no Oshigoto', 'yuutousei-to-himitsu-no-oshigoto', 'http://truyendep.com/wp-content/uploads/2020/02/yuutousei-to-himitsu-no-oshigoto.jpg', '\n<h2>Yuutousei to Himitsu no Oshigoto n&#x1ED9;i dung</h2>\n<p>Shimizu Azusa, n&#x1EEF; sinh nghi&#xEA;m t&#xFA;c nh&#x1EA5;t trong ban k&#x1EF7; lu&#x1EAD;t c&#x1EE7;a tr&#x1B0;&#x1EDD;ng &#x111;&#x1B0;&#x1EE3;c th&#x1EEB;a k&#x1EBF; ti&#x1EC7;m s&#xE1;ch do cha &#x111;&#x1EC3; l&#x1EA1;i. V&#xE0; &#x111;i&#x1EC1;u c&#xF4; kh&#xF4;ng ng&#x1EDD; &#x111;&#x1B0;&#x1EE3;c, ti&#x1EC7;m s&#xE1;ch n&#xE0;y c&#xF2;n b&#xE1;n c&#x1EA3; sex toy v&#xE0; c&#xE1;c c&#xF4;ng c&#x1EE5; li&#xEA;n quan. Li&#x1EC7;u c&#xF4; &#x1EA5;y c&#xF3; th&#x1EC3; qu&#x1EA3;n l&#xFD; th&#xE0;nh c&#xF4;ng ti&#x1EC7;m s&#xE1;ch n&#xE0;y?</p>\n', 'http://truyendep.com/yuutousei-to-himitsu-no-oshigoto/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(59, 'Tây Du Phiền Phức Ký', 'tay-du-phin-phc-k', 'http://truyendep.com/wp-content/uploads/2020/02/tay-du-phien-phuc-ky.jpg', '\n<h2>T&#xE2;y Du Phi&#x1EC1;n Ph&#x1EE9;c K&#xFD; n&#x1ED9;i dung</h2>\n<p>C&#xE2;u chuy&#x1EC7;n h&#xE0;i h&#x1B0;&#x1EDB;c v&#x1EC1; chuy&#x1EBF;n h&#xE0;nh tr&#xEC;nh c&#x1EE7;a &#x110;&#x1B0;&#x1EDD;ng Tam T&#x1EA1;ng &#x111;&#x1EBF;n Thi&#xEA;n Tr&#xFA;c th&#x1EC9;nh kinh d&#x1B0;&#x1EDB;i c&#xE1;c b&#xE0;i test c&#x1EF1;c k&#xEC; &#x201C;&#xE1;p l&#x1EF1;c&#x201D; &#x111;&#x1EBF;n t&#x1EEB; Quan &#xC2;m. M&#x1ED9;t h&#xE0;nh tr&#xEC;nh cam go v&#x1EDB;i &#x111;&#x1EA7;y M&#xF4;ng v&#xE0; V&#x1EBF;u &#x111;&#xE3; b&#x1EAF;t &#x111;&#x1EA7;u!!</p>\n', 'http://truyendep.com/tay-du-phien-phuc-ky/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(60, 'The Last Saiyuki', 'the-last-saiyuki', 'http://truyendep.com/wp-content/uploads/2020/02/the-last-saiyuki.jpg', '\n<h2>The Last Saiyuki n&#x1ED9;i dung</h2>\n<p>Tr&#x1EDF; v&#x1EC1; t&#x1EEB; tr&#x1B0;&#x1EDD;ng, h&#x1ECD;c sinh n&#x103;m ba Ryunosuke &#x111;&#x1B0;&#x1EE3;c gi&#x1EDB;i thi&#x1EC7;u v&#x1EDB;i m&#x1ED9;t c&#xF4; g&#xE1;i tr&#x1EBB;. Cha c&#x1EAD;u r&#x1EB1;ng c&#xF4; s&#x1EBD; l&#xE0; em g&#xE1;i c&#x1EE7;a c&#x1EAD;u b&#x1EAF;t &#x111;&#x1EA7;u t&#x1EEB; ng&#xE0;y &#x111;&#xF3;. T&#xEA;n c&#xF4; &#x1EA5;y l&#xE0; Koharu. C&#xF4; b&#x1ECB; m&#xF9; v&#xE0; tay,&#xA0;ch&#xE2;n &#x111;&#x1EC1;u&#xA0;l&#xE0; gi&#x1EA3;. C&#xF4; &#x1EA5;y n&#x1EAF;m gi&#x1EEF; trong m&#xEC;nh m&#x1ED9;t s&#x1EE9;c m&#x1EA1;nh ngo&#xE0;i t&#x1EA7;m hi&#x1EC3;u bi&#x1EBF;t c&#x1EE7;a con ng&#x1B0;&#x1EDD;i&#x2026; M&#x1ED9;t c&#xE2;u chuy&#x1EC7;n Saiyuki k&#x1EF3; qu&#xE1;i v&#xE0; tuy&#x1EC7;t v&#x1EDD;i cho m&#x1ED9;t th&#x1EBF; h&#x1EC7; m&#x1EDB;i!</p>\n', 'http://truyendep.com/the-last-saiyuki/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(61, 'Saru Lock', 'saru-lock', 'http://truyendep.com/wp-content/uploads/2020/02/saru-lock.jpg', '\n<h2>Saru Lock n&#x1ED9;i dung</h2>\n<p>Yataro Sarumaru, bi&#x1EC7;t danh: Saru, l&#xE0; m&#x1ED9;t thi&#xEA;n t&#xE0;i ph&#xE1; kh&#xF3;a v&#xE0; b&#x1ECB; d&#x1EA1;i g&#xE1;i c&#x1EA5;p 2 t&#x1EF7;. Ch&#xE0;ng trai tr&#x1EBB; n&#xE0;y s&#x1EAF;p &#x111;&#x1B0;&#x1EE3;c giao m&#x1ED9;t nhi&#x1EC7;m v&#x1EE5; &#x111;&#x1EB7;c bi&#x1EC7;t, &#x111;&#xE1;nh d&#x1EA5;u chuy&#x1EBF;n h&#xE0;nh tr&#xEC;nh &#x111;&#x1EC3; &#x111;&#x1EDD;i c&#x1EE7;a m&#xEC;nh!</p>\n', 'http://truyendep.com/saru-lock/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(62, 'Xúc Xắc Tử Thần', 'xuc-xc-t-thn', 'http://truyendep.com/wp-content/uploads/2020/02/xuc-xac-tu-than.jpg', '\n<h2>X&#xFA;c X&#x1EAF;c T&#x1EED; Th&#x1EA7;n n&#x1ED9;i dung</h2>\n<p>Nam sinh trung h&#x1ECD;c n&#x103;m bam Masamitsu Kamiza v&#xF4; t&#xEC;nh t&#xEC;m th&#x1EA5;y m&#x1ED9;t b&#xED; &#x1EA9;n trong ng&#x103;n b&#xE0;n c&#x1EE7;a em g&#xE1;i m&#xEC;nh. T&#xEC;nh c&#x1EDD; ph&#xE1;t hi&#x1EC7;n ra r&#x1EB1;ng x&#xFA;c x&#x1EAF;c &#x1EA5;y l&#xE0; phong &#x1EA5;n c&#x1EE7;a t&#x1EED; th&#x1EA7;n Batch, m&#x1ED9;t tr&#x1EAD;n c&#xE1; c&#x1B0;&#x1EE3;c &#x111;&#xE3; di&#x1EC5;n ra v&#x1EDB;i c&#xE1; gi&#xE1; ph&#x1EA3;i tr&#x1EA3; l&#xE0; ch&#xED;nh sinh m&#x1EA1;ng c&#x1EE7;a m&#xEC;nh!! Li&#x1EC7;u Kamizawa c&#xF3; th&#xE0;nh c&#xF4;ng tho&#xE1;t kh&#x1ECF;i t&#x1EED; th&#x1EA7;n Batch v&#xE0; nh&#x1EEF;ng k&#x1EBB; gi&#x1ED1;ng nh&#x1B0; m&#xEC;nh kh&#xF4;ng?</p>\n', 'http://truyendep.com/xuc-xac-tu-than/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(63, 'Love After World Domination', 'love-after-world-domination', 'http://truyendep.com/wp-content/uploads/2020/02/love-after-world-domination.jpg', '\n<h2>Love After World Domination n&#x1ED9;i dung</h2>\n<p>N&#xF3;i &#x111;&#x1A1;n gi&#x1EA3;n, romio &amp; juliet trong b&#x1ED1;i c&#x1EA3;nh th&#x1EBF; gi&#x1EDB;i &#x111;&#xE3; b&#x1ECB; x&#xE2;m l&#x1B0;&#x1EE3;c b&#x1EDF;i alien</p>\n', 'http://truyendep.com/love-after-world-domination/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(64, 'Watashi (Kari)', 'watashi-kari', 'http://truyendep.com/wp-content/uploads/2020/02/watashi-kari.jpg', '\n<h2>Watashi (Kari) n&#x1ED9;i dung</h2>\n<p>Ng&#x1B0;&#x1EDD;i y&#xEA;u c&#x1EE7;a Shio &#x2013; Iori &#x2013; &#x111;&#xE3; t&#xEC;m ra m&#x1ED9;t c&#xE1;i x&#xE1;c ngay trong nh&#xE0; c&#x1EE7;a c&#x1EAD;u. C&#x1EAD;u n&#xF3;i v&#x1EDB;i c&#xF4; trong run s&#x1EE3; r&#x1EB1;ng c&#x1EAD;u b&#x1ECB; m&#x1EA5;t tr&#xED; nh&#x1EDB;. V&#xEC; c&#xF4; y&#xEA;u c&#x1EAD;u, c&#xF4; &#x111;&#xE3; gi&#xFA;p c&#x1EAD;u th&#x1EE7; ti&#xEA;u c&#xE1;i x&#xE1;c. C&#xF4; &#xF4;m l&#x1EA5;y c&#x1EAD;u t&#x1EEB; ph&#xED;a sau, tuy&#xEA;n b&#x1ED1; r&#x1EB1;ng c&#x1EAD;u l&#xE0; m&#x1ED9;t ng&#x1B0;&#x1EDD;i r&#x1EA5;t quan tr&#x1ECD;ng v&#x1EDB;i c&#xF4; &#x1EA5;y. Tuy nhi&#xEA;n, k&#x1EBB; &#x111;&#xE3; d&#xE0;n x&#x1EBF;p th&#x1EA3;m k&#x1ECB;ch &#x1EA5;y ch&#xED;nh l&#xE0; Shio. H&#x1A1;n n&#x1EEF;a, &#x111;&#x1EA5;y l&#xE0; k&#x1EBB; l&#x1EA1; m&#x1EB7;t &#x111;&#xE3; gi&#x1EBF;t ch&#x1EBF;t Shio v&#xE0; c&#x1B0;&#x1EDB;p l&#x1EA5;y danh t&#xED;nh c&#x1EE7;a c&#xF4; g&#xE1;i &#x111;&#xF3;.</p>\n', 'http://truyendep.com/watashi-kari/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(65, 'Phòng Tập Gym Bí Mật', 'phong-tp-gym-bi-mt', 'http://truyendep.com/wp-content/uploads/2020/02/phong-tap-gym-bi-mat.jpg', '\n<h2>Ph&#xF2;ng T&#x1EAD;p Gym B&#xED; M&#x1EAD;t n&#x1ED9;i dung</h2>\n<p>Truy&#x1EC7;n v&#x1EC1; thanh ni&#xEA;n m&#x169;m m&#x129;m &#x111;i t&#xEC;m ph&#xF2;ng gym &#x1EDF; g&#x1EA7;n nh&#xE0; &#x111;&#x1EC3; gi&#x1EA3;m c&#xE2;n. M&#x1ECD;i th&#x1EE9; b&#x1EAF;t &#x111;&#x1EA7;u khi thanh ni&#xEA;n c&#xF2;n zin bu&#x1ED9;c ph&#x1EA3;i k&#xED; h&#x1EE3;p &#x111;&#x1ED3;ng c&#x1EE7;a ph&#xF2;ng t&#x1EAD;p v&#xE0; tu&#xE2;n theo ph&#x1B0;&#x1A1;ng th&#x1EE9;c t&#x1EAD;p k&#x1EF3; l&#x1EA1; : Th&#x1EC3; d&#x1EE5;c b&#x1EB1;ng c&#xE1;c b&#xE0;i t&#x1EAD;p &quot;ch&#x1ED1;ng &#x111;&#x1EA9;y&quot;</p>\n', 'http://truyendep.com/phong-tap-gym-bi-mat/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(66, 'Tengoku Daimakyou', 'tengoku-daimakyou', 'http://truyendep.com/wp-content/uploads/2020/02/tengoku-daimakyou.jpg', '\n<h2>Tengoku Daimakyou n&#x1ED9;i dung</h2>\n<p>C&#xE2;u chuy&#x1EC7;n &#x111;&#x1B0;&#x1EE3;c &#x111;&#x1EB7;t trong hai th&#x1EBF; gi&#x1EDB;i ri&#xEA;ng bi&#x1EC7;t. Tokio s&#x1ED1;ng v&#x1EDB;i nh&#x1EEF;ng &#x111;&#x1EE9;a tr&#x1EBB; kh&#xE1;c trong m&#x1ED9;t th&#x1EBF; gi&#x1EDB;i &#x111;&#x1B0;&#x1EE3;c bao quanh b&#x1EDF;i m&#x1ED9;t b&#x1EE9;c t&#x1B0;&#x1EDD;ng xinh &#x111;&#x1EB9;p, nh&#x1B0;ng m&#x1ED9;t ng&#xE0;y n&#x1ECD;, c&#x1EAD;u nh&#x1EAD;n &#x111;&#x1B0;&#x1EE3;c m&#x1ED9;t tin nh&#x1EAF;n c&#xF3; n&#x1ED9;i dung: &quot;B&#x1EA1;n c&#xF3; mu&#x1ED1;n &#x111;i ra b&#xEA;n ngo&#xE0;i c&#x1EE7;a b&#xEA;n ngo&#xE0;i kh&#xF4;ng?&quot; Trong khi &#x111;&#xF3;, m&#x1ED9;t c&#x1EAD;u b&#xE9; t&#xEA;n Maru &#x111;i du l&#x1ECB;ch v&#x1EDB;i m&#x1ED9;t ng&#x1B0;&#x1EDD;i ph&#x1EE5; n&#x1EEF; l&#x1EDB;n tu&#x1ED5;i, t&#xEC;m ra s&#x1EF1; t&#x1ED3;n t&#x1EA1;i &#xED;t &#x1ECF;i trong m&#x1ED9;t th&#x1EBF; gi&#x1EDB;i &#x111;&#x1ED5; n&#xE1;t khi h&#x1ECD; t&#xEC;m ki&#x1EBF;m &quot;thi&#xEA;n &#x111;&#x1B0;&#x1EDD;ng&quot;.</p>\n', 'http://truyendep.com/tengoku-daimakyou/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(67, 'An Evil Dragon That Was Sealed Away For 300 Years Became My Friend', 'an-evil-dragon-that-was-sealed-away-for-300-years-became-my-friend', 'http://truyendep.com/wp-content/uploads/2020/02/an-evil-dragon-that-was-sealed-away-for-300-years-became-my-friend.jpg', '\n<h2>An Evil Dragon That Was Sealed Away For 300 Years Became My Friend n&#x1ED9;i dung</h2>\n', 'http://truyendep.com/an-evil-dragon-that-was-sealed-away-for-300-years-became-my-friend/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:11'),
(68, 'Ký sinh trùng', 'k-sinh-trung', 'http://truyendep.com/wp-content/uploads/2020/02/ky-sinh-trung.jpg', '\n<h2>K&#xFD; sinh tr&#xF9;ng n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t ch&#x1EE7;ng lo&#xE0;i k&#xED; sinh kh&#xE1;t m&#xE1;u &#x111;ang d&#x1EA7;n xu&#x1EA5;t hi&#x1EC7;n, ch&#xFA;ng k&#xED; sinh v&#xE0;o trong c&#x1A1; th&#x1EC3; s&#x1ED1;ng v&#xE0; b&#x1EAF;t &#x111;&#x1EA7;u ph&#xE1;t tri&#x1EC3;n, li&#x1EC7;u con ng&#x1B0;&#x1EDD;i c&#xF3; th&#x1EC3; ch&#x1ED1;ng l&#x1EA1;i ch&#xFA;ng kh&#xF4;ng?</p>\n', 'http://truyendep.com/ky-sinh-trung/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:08'),
(69, 'The Swordsman Called The Countless Swords Sorcerer', 'the-swordsman-called-the-countless-swords-sorcerer', 'http://truyendep.com/wp-content/uploads/2020/02/the-swordsman-called-the-countless-swords-sorcerer.jpg', '\n<h2>The Swordsman Called The Countless Swords Sorcerer n&#x1ED9;i dung</h2>\n<p>C&#xE2;u truy&#x1EC7;n k&#x1EC3; v&#x1EC1; ch&#xE0;ng ki&#x1EBF;m s&#x129; may m&#x1EAF;n l&#x1B0;&#x1EE3;m &#x111;&#x1B0;&#x1EE3;c 2 b&#xE9; loli khi &#x111;ang l&#xE0;m nhi&#x1EC7;m v&#x1EE5;. . . Mu&#x1ED1;n bi&#x1EBF;t di&#x1EC5;n bi&#x1EBF;n nh&#x1B0; th&#x1EBF; n&#xE0;o, &#x111;&#x1EE3;i h&#x1ED3;i sau s&#x1EBD; r&#xF5; :v</p>\n', 'http://truyendep.com/the-swordsman-called-the-countless-swords-sorcerer/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:08'),
(70, 'Himenospia', 'himenospia', 'http://truyendep.com/wp-content/uploads/2020/02/himenospia.jpg', '\n<h2>Himenospia n&#x1ED9;i dung</h2>\n<p>B&#x1ECB; h&#xE0;nh h&#x1EA1;&#xA0;nh&#x1B0; m&#x1ED9;t n&#xF4; l&#x1EC7; c&#x1EE7;a m&#x1ECD;i ng&#x1B0;&#x1EDD;i &#x1EDF; tr&#x1B0;&#x1EDD;ng, b&#x1ECB; ng&#x1B0;&#x1EDD;i m&#x1EB9; &#x111;&#x1A1;n th&#xE2;n&#xA0;c&#x1EE7;a m&#xEC;nh gi&#xE0;y&#xA0;v&#xF2; khi &#x1EDF; nh&#xE0;, &#x111;&#xF3; l&#xE0;&#xA0;cu&#x1ED9;c s&#x1ED1;ng h&#xE0;ng ng&#xE0;y c&#x1EE7;a Endou Himeno. Tuy nhi&#xEA;n, m&#x1ED9;t ng&#xE0;y n&#x1ECD;, m&#x1ED9;t con ong k&#xEC; l&#x1EA1; &#x111;&#xE3; tr&#xED;ch v&#xE0;o ng&#x1B0;&#x1EDD;i c&#xF4; khi&#x1EBF;n cho m&#x1ECD;i th&#x1EE9; thay &#x111;&#x1ED5;i &#x2013; s&#x1ED1; ph&#x1EAD;n c&#x1EE7;a c&#xF4;, v&#xE0; s&#x1ED1; ph&#x1EAD;n&#xA0;c&#x1EE7;a c&#x1EA3;&#xA0;nh&#xE2;n lo&#x1EA1;i.&#xA0;M&#x1ED9;t c&#xE2;u chuy&#x1EC7;n h&#x1ED3;i h&#x1ED9;p v&#xE0; ly k&#xEC;&#xA0;v&#x1EC1; lo&#xE0;i&#xA0;c&#xF4;n tr&#xF9;ng b&#x1EAF;t &#x111;&#x1EA7;u!</p>\n', 'http://truyendep.com/himenospia/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(71, 'Hinomoto Sanshimai wa Kamatte Hoshii', 'hinomoto-sanshimai-wa-kamatte-hoshii', 'http://truyendep.com/wp-content/uploads/2020/02/hinomoto-sanshimai-wa-kamatte-hoshii.jpg', '\n<h2>Hinomoto Sanshimai wa Kamatte Hoshii n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t thanh ni&#xEA;n b&#x1ED7;ng c&#xF3; th&#xEA;m 3 ch&#x1ECB; em g&#xE1;i</p>\n', 'http://truyendep.com/hinomoto-sanshimai-wa-kamatte-hoshii/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:08'),
(72, 'Kimi No Koto Ga Dai Dai Dai Dai Daisuki Na 100-ri No Kanojo', 'kimi-no-koto-ga-dai-dai-dai-dai-daisuki-na-100-ri-no-kanojo', 'http://truyendep.com/wp-content/uploads/2020/02/kimi-no-koto-ga-dai-dai-dai-dai-daisuki-na-100-ri-no-kanojo.jpg', '\n<h2>Kimi No Koto Ga Dai Dai Dai Dai Daisuki Na 100-ri No Kanojo n&#x1ED9;i dung</h2>\n<p>Truy&#x1EC7;n k&#x1EC3; v&#x1EC1; m&#x1ED9;t thanh ni&#xEA;n sinh ho&#x1EA1;t t&#x1ED1;t &#x111;i t&#x1ECF; t&#xEC;nh nh&#x1EEF;ng 100 c&#xF4; g&#xE1;i (t&#x1EEB; l&#xFA;c m&#x1EDB;i c&#xF3; 8 th&#xE1;ng tu&#x1ED5;i) NH&#x1AF;NG &#x110;&#x1EC0;U B&#x1ECA; T&#x1EEA; CH&#x1ED0;I!!!&#xA0;&#xA0;v&#xE0; r&#x1ED3;i th&#xEC; chuy&#x1EC7;n g&#xEC; &#x111;&#x1EBF;n c&#x169;ng ph&#x1EA3;i &#x111;&#x1EBF;n khi th&#x1EA7;n t&#xEC;nh y&#xEA;u n&#xF3;i r&#x1EB1;ng l&#xE0; cu c&#x1EAD;u n&#xE0;y s&#x1EBD; c&#xF3; 100 ng&#x1B0;&#x1EDD;i b&#x1EA1;n t&#xE2;m giao&#xA0;THA H&#x1ED2; M&#xC0; L&#x1EF0;A CH&#x1ECC;N&#xA0;V&#x1EAD;y anh main nh&#xE0; ta s&#x1EBD; ch&#x1ECD;n ai &#x111;&#xE2;y</p>\n', 'http://truyendep.com/kimi-no-koto-ga-dai-dai-dai-dai-daisuki-na-100-ri-no-kanojo/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(73, '4 Cut Hero', '4-cut-hero', 'http://truyendep.com/wp-content/uploads/2020/02/nguoi-hung-song-ao.jpg', '\n<h2>4 Cut Hero n&#x1ED9;i dung</h2>\n<p>1 thanh ni&#xEA;n t&#x1EF1; k&#x1EF7; s&#x1ED1;ng &#x1EA3;o ch&#xED;nh hi&#x1EC7;u, &#x111;&#x1EAF;m ch&#xEC;m trong th&#x1EBF; gi&#x1EDB;i game (&#x1EDF; &#x111;&#xE2;y l&#xE0; RPG nh&#xF3;e), c&#xF9;ng &#x111;&#xF3;n xem chuy&#x1EC7;n g&#xEC; s&#x1EBD; x&#x1EA3;y ra v&#x1EDB;i anh main c&#x1EE7;a ch&#xFA;ng ta nh&#xE9;)</p>\n', 'http://truyendep.com/4-cut-hero-2/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(74, 'Sa-chan, boku wa', 'sa-chan-boku-wa', 'http://truyendep.com/wp-content/uploads/2020/02/sa-chan-boku-wa.jpg', '\n<h2>Sa-chan, boku wa n&#x1ED9;i dung</h2>\n<p>Th&#xE2;n g&#x1EED;i, Sa-chan. Gi&#xE1; nh&#x1B0; ng&#xE0;y &#x111;&#xF3; ch&#xFA;ng ta ti&#x1EBF;n t&#x1EDB;i &#x201C;t&#x1EAD;n c&#xF9;ng&#x201D;, c&#xF3; l&#x1EBD; gi&#x1EDD; &#x111;&#xE2;y t&#x1EDB; &#x111;&#xE3; kh&#xF4;ng sa &#x111;&#x1ECD;a v&#xE0;o con &#x111;&#x1B0;&#x1EDD;ng tai h&#x1EA1;i n&#xE0;y.</p>\n', 'http://truyendep.com/sa-chan-boku-wa/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(75, 'Khu phố xa xăm', 'khu-ph-xa-xm', 'http://truyendep.com/wp-content/uploads/2020/02/khu-pho-xa-xam.jpg', '\n<h2>Khu ph&#x1ED1; xa x&#x103;m n&#x1ED9;i dung</h2>\n<p>Hiroshi Nakahara, m&#x1ED9;t nh&#xE2;n vi&#xEA;n l&#xE0;m c&#xF4;ng &#x103;n l&#x1B0;&#x1A1;ng &#x1EDF; tu&#x1ED5;i trung ni&#xEA;n v&#xF4; t&#xEC;nh b&#x1EAF;t nh&#x1EA7;m t&#xE0;u v&#x1EC1; qu&#xEA; th&#x103;m m&#x1ED9; m&#x1EB9;. Kh&#xF4;ng r&#xF5; v&#xEC; nguy&#xEA;n nh&#xE2;n g&#xEC;, Hiroshi &#x111;&#xE3;&#xA0;b&#x1ECB; &#x111;&#x1B0;a v&#x1EC1; qu&#xE1; kh&#x1EE9;, anh ta nh&#x1EAD;n ra m&#xEC;nh &#x111;&#xE3; tr&#x1EDF; th&#xE0;nh h&#x1ECD;c sinh l&#x1EDB;p 8 th&#xEA;m l&#x1EA7;n n&#x1EEF;a, nh&#x1B0;ng v&#x1EDB;i t&#x1EA5;t c&#x1EA3; c&#xE1;c k&#xFD; &#x1EE9;c c&#x1EE7;a m&#x1ED9;t ng&#x1B0;&#x1EDD;i l&#x1EDB;n.&#xA0; &#xA0; Li&#x1EC7;u Hiroshi c&#xF3; th&#x1EC3;, ho&#x1EB7;c c&#xF3; n&#xEA;n thay &#x111;&#x1ED5;i c&#xE1;c quy&#x1EBF;t &#x111;&#x1ECB;nh m&#xE0; m&#xEC;nh &#x111;&#xE3; l&#xE0;m tr&#x1B0;&#x1EDB;c &#x111;&#xE2;y hay kh&#xF4;ng? Nh&#x1B0;ng quan tr&#x1ECD;ng h&#x1A1;n h&#x1EBF;t, li&#x1EC7;u anh ta c&#xF3;&#xA0; t&#xEC;m &#x111;&#x1B0;&#x1EE3;c c&#xE1;ch &#x111;&#x1EC3; tr&#x1EDF; v&#x1EC1; hi&#x1EC7;n t&#x1EA1;i hay kh&#xF4;ng, hay l&#xE0; anh ta b&#x1ECB; m&#x1EAF;c k&#x1EB9;t trong qu&#xE1; kh&#x1EE9; ?</p>\n', 'http://truyendep.com/khu-pho-xa-xam/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(76, 'Uchi no Kaisha no Chiisai Senpai no Hanashi', 'uchi-no-kaisha-no-chiisai-senpai-no-hanashi', 'http://truyendep.com/wp-content/uploads/2020/02/uchi-no-kaisha-no-chiisai-senpai-no-hanashi.jpg', '\n<h2>Uchi no Kaisha no Chiisai Senpai no Hanashi n&#x1ED9;i dung</h2>\n<p>Chuy&#x1EC7;n v&#x1EC1; anh nh&#xE2;n vi&#xEA;n v&#xE0; &#x111;&#xE0;n ch&#x1ECB; nh&#x1ECF; nh&#x1EAF;n</p>\n', 'http://truyendep.com/uchi-no-kaisha-no-chiisai-senpai-no-hanashi/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
