(88, 'Toumei Ningen no Hone', 'toumei-ningen-no-hone', 'http://truyendep.com/wp-content/uploads/2020/02/toumei-ningen-no-hone.jpeg', '\n<h2>Toumei Ningen no Hone n&#x1ED9;i dung</h2>\n<p>C&#xE2;u chuy&#x1EC7;n t&#xE2;m l&#xFD; k&#x1EC3; v&#x1EC1;Kinomiya Aya &#x2013; c&#xF4; con g&#xE1;i &#x111;&#xE3; c&#xF9;ng s&#x1ED1;ng trong m&#x1ED9;t gia &#x111;&#xEC;nh n&#x1A1;ing&#x1B0;&#x1EDD;i b&#x1ED1; th&#xEC; ng&#x1B0;&#x1EE3;c &#x111;&#xE3;i trong khi th&#x1EB1;nganh th&#xEC; th&#x1EDD; &#x1A1;, ng&#x1B0;&#x1EDD;i m&#x1EB9; bu&#x1ED9;c l&#xE0; ng&#x1B0;&#x1EDD;i ph&#x1EA3;i h&#x1EE9;ng ch&#x1ECB;u t&#x1EA5;t c&#x1EA3; nh&#x1EEF;ng t&#x1EE7;i nh&#x1EE5;c. V&#xE0;o m&#x1ED9;t ng&#xE0;y n&#x1ECD;, c&#xF4; &#x111;&#xE3; bu&#x1ED9;t mi&#x1EC7;ng &#x1B0;&#x1EDB;c r&#x1EB1;ng: &quot;M&#xEC;nh kh&#xF4;ng mu&#x1ED1;n &#x1EDF; &#x111;&#xE2;y n&#x1EEF;a&#x2026;&quot; v&#xE0; sau &#x111;&#xF3; c&#xF4; ch&#x1EE3;t c&#xF3; kh&#x1EA3; n&#x103;ng t&#xE0;ng h&#xEC;nh&#x2026;?Kinomiya Aya s&#x1EBD; t&#xEC;m l&#x1EA1;i cu&#x1ED9;c s&#x1ED1;ng h&#x1EA1;nh ph&#xFA;c c&#x1EE7;a m&#xEC;nh nh&#x1B0; th&#x1EBF; n&#xE0;o &#x111;&#xE2;y? Nh&#x1EDB; &#x1EE7;ng h&#x1ED9; t&#x1EA1;i Fanpage c&#x1EE7;a t&#x1EE5;i m&#xEC;nh &#x111;&#x1EC3; truy&#x1EC7;n ra nhanh nh&#x1EA5;t c&#xF3; th&#x1EC3; nhaaa!! facebook.com/NireiTeam</p>\n', 'http://truyendep.com/toumei-ningen-no-hone/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(89, 'Phép Thuật Thánh Nữ Toàn Năng', 'phep-thut-thanh-n-toan-nng', 'http://truyendep.com/wp-content/uploads/2020/02/phep-thuat-thanh-nu-toan-nang.jpeg', '\n<h2>Ph&#xE9;p Thu&#x1EAD;t Th&#xE1;nh N&#x1EEF; To&#xE0;n N&#x103;ng n&#x1ED9;i dung</h2>\n<p>Sei, nh&#xE2;n vi&#xEA;n v&#x103;n ph&#xF2;ng 20 tu&#x1ED5;i &#x111;&#x1B0;&#x1EE3;c tri&#x1EC7;u h&#x1ED3;i sang th&#x1EBF; gi&#x1EDB;i kh&#xE1;c sau 1 ng&#xE0;y &#x111;i l&#xE0;m qu&#xE1; gi&#x1EDD;. Nh&#x1B0;ng m&#x1ED9;t ng&#x1B0;&#x1EDD;i &#x111;&#xE3; tri&#x1EC7;u h&#x1ED3;i, ch&#x1EA1;m m&#x1EB7;t c&#xF4; r&#x1ED3;i n&#xF3;i &quot; C&#xF4; &#x1EA5;y kh&#xF4;ng ph&#x1EA3;i l&#xE0; Th&#xE1;nh N&#x1EEF;.&quot; V&#x1EAD;y l&#xE0; di&#x1EC5;n bi&#x1EBF;n v&#x1EDF; k&#x1ECB;ch c&#x1EE9; th&#x1EBF; b&#x1ECB; b&#x1ECF; m&#x1EB7;c th&#x1EBF; sao? Sei r&#x1EDD;i kh&#x1ECF;i Cung &#x110;i&#x1EC7;n Ho&#xE0;ng Gia v&#xE0; che gi&#x1EA5;u th&#xE2;n ph&#x1EAD;n Th&#xE1;nh N&#x1EEF; c&#x1EE7;a m&#xEC;nh. C&#xF4; &#x1EA5;y b&#x1EAF;t &#x111;&#x1EA7;u l&#xE0;m vi&#x1EC7;c t&#x1EA1;i Vi&#x1EC7;n Nghi&#xEA;n c&#x1EE9;u n&#x1A1;i pha ch&#x1EBF; thu&#x1ED1;c potion v&#xE0; &#x111;&#x1ED3; trang &#x111;i&#x1EC3;m. C&#xF4; &#x1EA5;y &#x111;&#xE3; s&#x1EED; d&#x1EE5;ng ph&#xE1;p thu&#x1EAD;t v&#xEC; mong mu&#x1ED1;n c&#x1EE7;a m&#x1ECD;i ng&#x1B0;&#x1EDD;i v&#xE0; d&#x1EA7;n d&#x1EA7;n m&#x1ECD;i ng&#x1B0;&#x1EDD;i &#x111;&#x1EC1;u cho r&#x1EB1;ng c&#xF4; m&#x1EDB;i ch&#xED;nh l&#xE0; Th&#xE1;nh N&#x1EEF;&#x2026; Li&#x1EC7;u Sei c&#xF3; th&#x1EC3; t&#x1EAD;n h&#x1B0;&#x1EDF;ng cu&#x1ED9;c s&#x1ED1;ng ch&#x1EAD;m trong m&#x1A1; t&#x1EA1;i th&#x1EBF; gi&#x1EDB;i kh&#xE1;c m&#xE0; kh&#xF4;ng ai nh&#x1EAD;n ra th&#xE2;n ph&#x1EAD;n Th&#xE1;nh N&#x1EEF; c&#xF4; che gi&#x1EA5;u hay kh&#xF4;ng &#x111;&#xE2;y?</p>\n', 'http://truyendep.com/phep-thuat-thanh-nu-toan-nang/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(90, 'Trò chơi tìm xác', 'tro-chi-tim-xac', 'http://truyendep.com/wp-content/uploads/2020/02/tro-choi-tim-xac.jpg', '\n<h2>Tr&#xF2; ch&#x1A1;i t&#xEC;m x&#xE1;c n&#x1ED9;i dung</h2>\n<p>Ti&#x1EBF;p n&#x1ED1;i th&#xE0;nh c&#xF4;ng &#x1EDF; ph&#x1EA7;n 1, c&#xE2;u chuy&#x1EC7;n l&#x1EA7;n n&#xE0;y &#x111;&#x1B0;a ch&#xFA;ng ta &#x111;&#x1EBF;n 1 d&#xF2;ng th&#x1EDD;i gian kh&#xE1;c, n&#x1A1;i n&#xE0;y c&#x169;ng t&#x1ED3;n t&#x1EA1;i l&#x1EDD;i nguy&#x1EC1;n v&#x1EC1; &#x201C;&#xC1;o &#x110;&#x1ECF;&#x201D; ch&#x1EC9; kh&#xE1;c &#x111;&#xE2;y l&#xE0; 1 l&#x1EDD;i nguy&#x1EC1;n m&#xE1;u me h&#x1A1;n, d&#x1EEF; d&#x1ED9;i h&#x1A1;n v&#xE0; kh&#xF3; nh&#x1EB1;n h&#x1A1;n!! C&#xE1;c th&#xE0;nh vi&#xEA;n tham gia g&#x1EA7;n nh&#x1B0; ch&#x1EB3;ng th&#x1EC3; m&#x1EAF;c sai l&#x1EA7;m b&#x1EDF;i h&#x1ECD; ch&#x1EC9; c&#xF3; 7 ng&#xE0;y ho&#xE0;n th&#xE0;nh tr&#xF2; ch&#x1A1;i, ho&#x1EB7;c s&#x1EBD; ph&#x1EA3;i v&#x129;nh vi&#x1EC5;n ch&#x1EBF;t!!</p>\n', 'http://truyendep.com/tro-choi-tim-xac/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(91, 'Tối Cường Cuồng Binh', 'ti-cng-cung-binh', 'http://truyendep.com/wp-content/uploads/2020/02/toi-cuong-cuong-binh.jpg', '\n<h2>T&#x1ED1;i C&#x1B0;&#x1EDD;ng Cu&#x1ED3;ng Binh n&#x1ED9;i dung</h2>\n<p>Anh ta l&#xE0; k&#x1EBB; v&#xF4; c&#xF9;ng m&#x1EA1;nh m&#x1EBD; nh&#x1B0;ng l&#x1EA1;i &#x111;&#x1ED9;i l&#x1ED1;t m&#x1ED9;t ng&#x1B0;&#x1EDD;i b&#xEC;nh th&#x1B0;&#x1EDD;ng :v<br>\nNhi&#x1EC7;m v&#x1EE5; c&#x1EE7;a anh ta l&#xE0; b&#x1EA3;o v&#x1EC7; &#x110;&#x1EA1;i Ti&#x1EC3;u Th&#x1B0; c&#x1EE7;a t&#x1EAD;p &#x110;o&#xE0;n T&#x1EA5;t Khang. Khi c&#xE1;c th&#x1EBF; l&#x1EF1;c &#x111;en t&#x1ED1;i mu&#x1ED1;n c&#xF3; c&#xE1;ch ch&#x1EBF; t&#x1EA1;o c&#x1EE7;a c&#xF4; &#x1EA5;y. Anh ta s&#x1EBD; l&#xE0;m g&#xEC; &#x111;&#x1EC3; b&#x1EA3;o v&#x1EC7; &#x111;&#x1B0;&#x1EE3;c c&#xF4; &#x1EA5;y &#x111;&#xE2;y<br>\nChuy&#x1EC7;n g&#xEC; s&#x1EBD; x&#x1EA3;y ra !!!<br>\nH&#xE3;y theo d&#xF5;i truy&#x1EC7;n nh&#xE9; !!<br>\nNh&#xE2;n v&#x1EAD;t ch&#xED;nh : L&#xE2;m Ng&#x1EA1;o Tuy&#x1EBF;t ( N&#x1EEF; Ch&#xED;nh )<br>\nT&#xF4; Nhu&#x1EC7; ( Nam Ch&#xED;nh ) &#x2026;v..v&#x2026;</p>\n', 'http://truyendep.com/toi-cuong-cuong-binh/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(92, 'SOBIWAKU ZERO NO SAIKYOU KENSHI DEMO, NOROI NO SOUBI (KAWAI) NARA 9999-KO TSUKE-HODAI', 'sobiwaku-zero-no-saikyou-kenshi-demo-noroi-no-soubi-kawai-nara-9999-ko-tsuke-hodai', 'http://truyendep.com/wp-content/uploads/2020/02/sobiwaku-zero-no-saikyou-kenshi-demo-noroi-no-soubi-kawai-nara-9999-ko-tsuke-hodai.jpg', '\n<h2>SOBIWAKU ZERO NO SAIKYOU KENSHI DEMO, NOROI NO SOUBI (KAWAI) NARA 9999-KO TSUKE-HODAI n&#x1ED9;i dung</h2>\n<p>T&#x1EA1;i m&#x1ED9;t th&#x1EBF; gi&#x1EDB;i n&#x1A1;i m&#xE0; ai n&#x1EAF;m gi&#x1EEF; nhi&#x1EC1;u gi&#x1EDB;i h&#x1EA1;n trang b&#x1ECB; s&#x1EBD; l&#xE0; k&#x1EBB; h&#xF9;ng m&#x1EA1;nh, nh&#xE2;n v&#x1EAD;t ch&#xED;nh c&#x1EE7;a ch&#xFA;ng ta b&#x1ECB; m&#x1ECD;i ng&#x1B0;&#x1EDD;i khinh mi&#x1EC7;t v&#x1EDB;i bi&#x1EC7;t danh l&#xE0; &quot;Noroa Zero&quot; v&#xEC; kh&#xF4;ng th&#x1EC3; mang &#x111;&#x1B0;&#x1EE3;c trang b&#x1ECB; nh&#x1B0; ng&#x1B0;&#x1EDD;i kh&#xE1;c. T&#xEC;nh c&#x1EDD; c&#x1EAD;u g&#x1EB7;p &#x111;&#x1B0;&#x1EE3;c m&#x1ED9;t c&#xF4; b&#xFA;p b&#xEA;, l&#xE0; m&#x1ED9;t trang b&#x1ECB; &quot;nguy&#x1EC1;n r&#x1EE7;a&quot; m&#xE0; ai ai c&#x169;ng n&#xE9; xa, li&#x1EC7;u &#x111;&#xE2;y c&#xF3; ph&#x1EA3;i l&#xE0; &#x111;&#x1ECB;nh m&#x1EC7;nh? M&#x1ED9;t k&#x1EBB; t&#x1EEB; &quot;Zero&quot; c&#xF3; th&#x1EC3; tr&#x1EDF; th&#xE0;nh ng&#x1B0;&#x1EDD;i m&#x1EA1;nh nh&#x1EA5;t th&#x1EBF; gi&#x1EDB;i hay ch&#x103;ng!?</p>\n', 'http://truyendep.com/sobiwaku-zero-no-saikyou-kenshi-demo-noroi-no-soubi-kawai-nara-9999-ko-tsuke-hodai/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(93, 'Tsubasa-chan, Kimi Wa. Macchingu Shita Onna Wa Satsujinki', 'tsubasa-chan-kimi-wa-macchingu-shita-onna-wa-satsujinki', 'http://truyendep.com/wp-content/uploads/2020/02/tsubasa-chan-kimi-wa-macchingu-shita-onna-wa-satsujinki.jpg', '\n<h2>Tsubasa-chan, Kimi Wa. Macchingu Shita Onna Wa Satsujinki n&#x1ED9;i dung</h2>\n<p>Sousuke, m&#x1ED9;t sinh vi&#xEA;n &#x111;&#x1EA1;i h&#x1ECD;c nohope, ch&#x1EC9; c&#xF3; th&#x1EC3; t&#xEC;m th&#x1EA5;y ni&#x1EC1;m vui tr&#xEA;n 1 app h&#x1EB9;n h&#xF2; v&#xE0; t&#xEC;m &#x111;&#x1B0;&#x1EE3;c m&#x1ED9;t c&#xF4; g&#xE1;i c&#xF3; t&#xEA;n l&#xE0; tsubasa-chan, m&#x1ED9;t c&#xF4; g&#xE1;i hi&#x1EC1;n l&#xE0;nh v&#xE0; d&#x1EC5; th&#x1B0;&#x1A1;ng. Nh&#x1EAF;n tin c&#xF9;ng c&#xF4; &#x1EA5;y c&#x1EAD;u th&#x1B0;&#x1EDD;ng g&#x1EB7;p nhi&#x1EC1;u chuy&#x1EC7;n t&#x1ED1;t &#x111;&#x1EB9;p. Nh&#x1B0;ng m&#xE0; c&#xF4; &#x1EA5;y l&#xE0; ai. V&#xE0; m&#x1ED9;t trong s&#x1ED1; nh&#x1EEF;ng tin nh&#x1EAF;n c&#x1EE7;a c&#x1EAD;u &#x111;&#xE3; b&#x1EAF;t &#x111;&#x1EA7;u v&#xE9;n l&#xEA;n nh&#x1EEF;ng ng&#xE0;y th&#xE1;ng &#x111;&#x1ECB;a ng&#x1EE5;c c&#x1EE7;a m&#xEC;nh. Tsubasa chan ph&#xE1; hu&#x1EF7; m&#x1ECD;i th&#x1EE9; c&#x1EE7;a t&#xF4;i, b&#x1EAF;t &#x111;&#x1EA7;u c&#xE2;u chuy&#x1EC7;n h&#x1ED3;i h&#x1ED9;p v&#xE0; b&#x1EA5;t kh&#x1EA3; kh&#xE1;ng c&#x1EE7;a m&#xEC;nh</p>\n', 'http://truyendep.com/tsubasa-chan-kimi-wa-macchingu-shita-onna-wa-satsujinki/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(94, 'ISEKAI DESU GA MAMONO SAIBAI SHITEIMASU', 'isekai-desu-ga-mamono-saibai-shiteimasu', 'http://truyendep.com/wp-content/uploads/2020/02/isekai-desu-ga-mamono-saibai-shiteimasu.jpg', '\n<h2>ISEKAI DESU GA MAMONO SAIBAI SHITEIMASU n&#x1ED9;i dung</h2>\n<p>B&#x1ECB; xuy&#xEA;n kh&#xF4;ng qua th&#x1EBF; gi&#x1EDB;i kh&#xE1;c m&#xE0; ch&#x1EB3;ng &#x111;&#x1B0;&#x1EE3;c nh&#x1B0; m&#x1A1;: Tr&#x1EA1;ng th&#xE1;i = y&#x1EBF;u x&#xEC;u K&#x1EF9; n&#x103;ng = kh&#xF4;ng Ti&#x1EC1;n b&#x1EA1;c = kh&#xF4;ng Ng&#x1B0;&#x1EDD;i quen = kh&#xF4;ng M&#x1EF9; nh&#xE2;n = ch&#x1B0;a xu&#x1EA5;t hi&#x1EC7;n &#x110;&#xE0;nh ph&#x1EA3;i t&#x1EF1; tr&#x1ED3;ng tr&#x1ECD;t ki&#x1EBF;m c&#xE1;i &#x103;n qua ng&#xE0;y th&#xF4;i, &#x1EA5;y th&#x1EBF; m&#xE0; v&#x1EE5; m&#xF9;a &#x111;&#x1EA7;u ti&#xEA;n l&#x1EA1;i tr&#x1ED3;ng &#x111;&#x1B0;&#x1EE3;c m&#x1ED9;t ru&#x1ED9;ng&#x2026;c&#xE2;y &#x103;n th&#x1ECB;t ng&#x1B0;&#x1EDD;i. Xuy&#xEA;n kh&#xF4;ng tr&#x1ED3;ng c&#xE2;y :v</p>\n', 'http://truyendep.com/isekai-desu-ga-mamono-saibai-shiteimasu/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(95, 'Slave Game', 'slave-game', 'http://truyendep.com/wp-content/uploads/2020/02/slave-game.jpg', '\n<h2>Slave Game n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t ng&#xE0;y, c&#x1EAD;u h&#x1ECD;c sinh c&#x1EA5;p 3 t&#xEA;n Kai nh&#x1EAD;n &#x111;&#x1B0;&#x1EE3;c m&#x1ED9;t email m&#x1EDD;i ch&#x1A1;i th&#x1EED; con game m&#x1EDB;i tr&#xEA;n &#x111;i&#x1EC7;n tho&#x1EA1;i c&#xF3; t&#xEA;n l&#xE0; &#x201C;Slave Go&#x201D;. Nh&#x1B0;ng nh&#x1EEF;ng ng&#x1B0;&#x1EDD;i xu&#x1EA5;t hi&#x1EC7;n trong game l&#x1EA7;n l&#x1EA7;n bi&#x1EBF;n m&#x1EA5;t m&#x1ED9;t c&#xE1;ch b&#xED; &#x1EA9;n&#x2026; m&#x1ED9;t tr&#xF2; ch&#x1A1;i nguy hi&#x1EC3;m v&#xE0; b&#x1EA1;o l&#x1EF1;c &#x111;&#x1B0;&#x1EE3;c khai m&#xE0;n&#x2026;!</p>\n', 'http://truyendep.com/slave-game/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(96, 'Dorei Yuugi (KIMURA Takashi)', 'dorei-yuugi-kimura-takashi', 'http://truyendep.com/wp-content/uploads/2020/02/unnamed.jpg', '\n<h2>Dorei Yuugi (KIMURA Takashi) n&#x1ED9;i dung</h2>\n<p>M&#x1ED9;t ng&#xE0;y, kai, m&#x1ED9;t h&#x1ECD;c sinh trung h&#x1ECD;c nh&#x1EAD;n &#x111;&#x1B0;&#x1EE3;c m&#x1ED9;t email b&#xED; &#x1EA9;n m&#x1EDD;i t&#x1EA3;i m&#x1ED9;t app m&#x1EDB;i. Nh&#x1EEF;ng ng&#x1B0;&#x1EDD;i b&#x1ECB; c&#x1EAD;u ta ch&#x1EE5;p b&#x1EB1;ng &#x1EE9;ng d&#x1EE5;ng &#x111;&#xF3;, &#x201C;SLAVE GO&#x201D;, &#x111;&#x1EC1;u m&#x1EA5;t t&#xED;ch. M&#x1ED9;t tr&#xF2; ch&#x1A1;i lu&#x1EA9;n qu&#x1EA9;n v&#xE0; t&#xE0;n nh&#x1EAB;n b&#x1EAF;t &#x111;&#x1EA7;u!!!www.facebook.com/Thodibiet/</p>\n', 'http://truyendep.com/dorei-yuugi-kimura-takashi/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(97, 'Shingeki No Eroko-san', 'shingeki-no-eroko-san', 'http://truyendep.com/wp-content/uploads/2020/02/shingeki-no-eroko-san.jpg', '\n<h2>Shingeki No Eroko-san n&#x1ED9;i dung</h2>\n<p>Shindou Eruko, ng&#x1B0;&#x1EDD;i &#x111;&#x1EB9;p ng&#x1EF1;c b&#x1EF1; &#x111;eo ki&#x1EBF;ng, &#x111;&#x1EBF;n l&#xE0;m th&#x1EE3; &#x1EDF; nh&#xE0; gi&#xFA;p vi&#x1EC7;c Amaguri v&#xE0; &#x111;&#x1ED5; ngay &#x111;&#x1ED3;ng nghi&#x1EC7;pHoshi-kun trong bu&#x1ED5;i &#x111;&#x1EA7;u l&#xE0;m chung, kh&#x1ED5; c&#xE1;i l&#xE0; em &#xFD; m&#x1EDB;i c&#x1EA5;p 3 c&#xF2;n b&#xE0; ch&#x1ECB; &#x111;&#xE2;y 27 tu&#x1ED5;i r&#x1ED3;i, l&#x1EA1;i c&#xF2;n&#x1EA3;o t&#x1B0;&#x1EDF;ng bi&#x1EBF;n th&#xE1;i n&#xEA;n l&#xFA;c n&#xE0;o c&#x169;ng m&#x1B0;u k&#x1EBF; &#x111;&#x1EC3; &#x111;&#x1B0;&#x1EE3;c ABCXYZ em &#xFD;&#x2026;</p>\n', 'http://truyendep.com/shingeki-no-eroko-san/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:08'),
(98, 'Dark Gathering', 'dark-gathering', 'http://truyendep.com/wp-content/themes/manga/images/default-thumbnail.jpg', '\n<h2>Dark Gathering n&#x1ED9;i dung</h2>\n<p>Keitarou, ch&#xE0;ng trai c&#xF3; kh&#x1EA3; n&#x103;ng thu h&#xFA;t ma qu&#x1EF7;, &#x111;&#x1B0;&#x1EE3;c thu&#xEA; l&#xE0;m gia s&#x1B0; cho m&#x1ED9;t c&#xF4; b&#xE9; mang t&#xEA;n g&#x1ECD;i Yayoi, ng&#x1B0;&#x1EDD;i c&#xF3; th&#x1EC3; tr&#xF4;ng th&#x1EA5;y ma qu&#x1EF7; v&#xE0; &#x111;ang trong c&#xF4;ng cu&#x1ED9;c t&#xEC;m ki&#x1EBF;m con ma &#x111;&#xE3; mang ng&#x1B0;&#x1EDD;i m&#x1EB9; c&#x1EE7;a m&#xEC;nh &#x111;i m&#x1EA5;t.</p>\n', 'http://truyendep.com/dark-gathering/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(99, 'Beyond Good and Evil', 'beyond-good-and-evil', 'http://truyendep.com/wp-content/uploads/2020/02/beyond-good-and-evil.jpeg', '\n<h2>Beyond Good and Evil n&#x1ED9;i dung</h2>\n<p>V&#x1EE5; vi&#x1EC7;c &#x111;&#xE3; &#x111;&#x1B0;&#x1EE3;c gi&#x1EA3;i quy&#x1EBF;t sau 52 gi&#x1EDD;. Trong kho&#x1EA3;ng th&#x1EDD;i gian &#x111;&#xF3; c&#xF3; 12 ng&#x1B0;&#x1EDD;i ch&#x1EBF;t. Trong m&#x1ED9;t ph&#xF2;ng h&#x1ECD;c kh&#xE9;p k&#xED;n, con ng&#x1B0;&#x1EDD;i &#x111;&#xE3; tr&#x1EDF; th&#xE0;nh th&#xFA; v&#x1EAD;t. 27 th&#xE0;nh vi&#xEA;n c&#x1EE7;a l&#x1EDB;p 6-2 c&#x169; &#x111;&#xE3; tham gia v&#xE0;o bu&#x1ED5;i h&#x1ECD;p l&#x1EDB;p t&#x1EA1;i tr&#x1B0;&#x1EDD;ng ti&#x1EC3;u h&#x1ECD;cShinodzuka. V&#xE0; c&#x1EE9; nh&#x1B0; v&#x1EAD;y, h&#x1ECD; b&#x1ECB; giam c&#x1EA7;m. K&#x1EBB; ch&#x1EE7; m&#x1B0;u l&#xE0;Yumesaki Mikio. C&#xE1;c th&#x1EF1;c nghi&#x1EC7;m &#x111;&#x1EC3; h&#x1ECF;iv&#x1EC1; &quot;t&#xED;nh thi&#x1EC7;n &#x1EDF; tr&#x1EA1;ng th&#xE1;i c&#x1EF1;c &#x111;i&#x1EC3;m&quot; &#x111;&#xE3; ph&#x1A1;i b&#xE0;y b&#x1EA3;n ch&#x1EA5;t c&#x1EE7;a con ng&#x1B0;&#x1EDD;i gi&#x1ED1;ng nh&#x1B0; l&#x1ED9;t &#x111;i l&#x1EDB;p da b&#xEA;n ngo&#xE0;i. S&#x1EF1; nghi ng&#x1EDD;, d&#x1EE5;c v&#x1ECD;ng, v&#x1EA1;ch tr&#x1EA7;n, ph&#x1EE5;c th&#xF9; v&#xE0; ph&#x1EA3;n b&#x1ED9;i. C&#xE2;u chuy&#x1EC7;n h&#x1ED3;i h&#x1ED9;p v&#x1EC1; vi&#x1EC7;c l&#xEA;n &#xE1;n &#x111;&#x1EA1;o &#x111;&#x1EE9;c v&#xE0;s&#x1EE5;p &#x111;&#x1ED5; lu&#xE2;n l&#xED;.</p>\n', 'http://truyendep.com/beyond-good-and-evil/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
(100, 'BUTA KOUSHAKU NI TENSEI SHITAKARA, KONDO WA KIMI NI SUKI TO IITAI', 'buta-koushaku-ni-tensei-shitakara-kondo-wa-kimi-ni-suki-to-iitai', 'http://truyendep.com/wp-content/uploads/2020/02/buta-koushaku-ni-tensei-shitakara-kondo-wa-kimi-ni-suki-to-iitai.jpg', '\n<h2>BUTA KOUSHAKU NI TENSEI SHITAKARA, KONDO WA KIMI NI SUKI TO IITAI n&#x1ED9;i dung</h2>\n<p>Sau khi &#x111;&#x1B0;&#x1EE3;c chuy&#x1EC3;n sinh th&#xE0;nh k&#x1EBB; ph&#x1EA3;n di&#x1EC7;n c&#x1EE7;a b&#x1ED9; anime y&#xEA;u th&#xED;ch, t&#xF4;i &quot;c&#xF4;ng t&#x1B0;&#x1EDB;c &#x1EE7;n &#x1EC9;n&quot; &#x111;&#x1B0;&#x1EE3;c &#x111;&#x1ECB;nh s&#x1EB5;n m&#x1ED9;t c&#xE1;i k&#x1EBF;t nh&#x1B0; shit. V&#x1EAD;y n&#xEA;n t&#xF4;i s&#x1EBD; s&#x1EED; d&#x1EE5;ng n&#x103;ng l&#x1EF1;c bi&#x1EBF;t tr&#x1B0;&#x1EDB;c t&#x1B0;&#x1A1;ng lai c&#x1EE7;a t&#xF4;i &#x111;&#x1EC3; tr&#x1EDF; n&#xEA;n n&#x1ED5;i ti&#x1EBF;ng v&#x1EDB;i nh&#x1EEF;ng nh&#xE2;n v&#x1EAD;t &#x111;&#xE3; gh&#xE9;t t&#xF4;i &#x1EDF; tr&#x1B0;&#x1EDD;ng v&#xE0; l&#x1EA7;n n&#xE0;y, ch&#x1EAF;c ch&#x1EAF;n t&#xF4;i s&#x1EBD; th&#x1ED5; l&#x1ED9;</p>\n', 'http://truyendep.com/buta-koushaku-ni-tensei-shitakara-kondo-wa-kimi-ni-suki-to-iitai/', 'Đang tiến hành', '2020-07-15 15:30:56', '2020-07-16 17:43:09'),
